"use strict";(self.webpackChunkdevlog=self.webpackChunkdevlog||[]).push([[8310],{6426:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/2022/12/21/CustomHook","metadata":{"permalink":"/devlog/blog/2022/12/21/CustomHook","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-21-CustomHook.md","source":"@site/blog/2022-12-21-CustomHook.md","title":"CustomHook","description":"How to use CustomHook","date":"2022-12-21T00:00:00.000Z","formattedDate":"2022\ub144 12\uc6d4 21\uc77c","tags":[{"label":"React.js","permalink":"/devlog/blog/tags/react-js"},{"label":"CustomHook","permalink":"/devlog/blog/tags/custom-hook"},{"label":"Typescript","permalink":"/devlog/blog/tags/typescript"}],"readingTime":5.045,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"title":"CustomHook","description":"How to use CustomHook","authors":"june","tags":["React.js","CustomHook","Typescript"]},"nextItem":{"title":"Webpack Project","permalink":"/devlog/blog/webpack"}},"content":"--- \\n\\nTypescirpt\uc640 React\ub85c \ud504\ub85c\uc81d\ud2b8\ub97c \uc9c4\ud589\ud558\uba74\uc11c \ubc18\ubcf5\uc801\uc73c\ub85c useEffect, useState\ub97c \uc0ac\uc6a9\ud558\ub294 \ucf54\ub4dc\ub97c \ubd24\uc2b5\ub2c8\ub2e4.  \\n\uac19\uc740 \ub85c\uc9c1\uc778\ub370 useState, useEffect\ub97c \uc0ac\uc6a9\ud55c\ub2e4\uba74 \ubd88\ud544\uc694\ud55c \ub80c\ub354\ub9c1\uc774 \ubc1c\uc0dd\ud558\uc600\uace0, \ub300\uc548\uc73c\ub85c \uc5b4\ub5a4 \ubc29\uc2dd\uc774 \uc788\uc744\uae4c \uace0\ubbfc\ud588\uc2b5\ub2c8\ub2e4.  \\n\uacf5\ud1b5\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 \ub85c\uc9c1\uc744 \uacf5\uc720\ud558\ub294 \ubc29\uc2dd \uc911, HoC(\uace0\ucc28 \ucef4\ud3ec\ub10c\ud2b8)\uc640 CustomHook\uc5d0 \uc911 Custom Hook \ub0b4\uc6a9\uc744 \uacf5\uc720\ud558\ub824\uace0 \ud569\ub2c8\ub2e4.  \\n\\n\\n# Custom Hook\uc774\ub780?\\n\\n\uc0ac\uc6a9\uc790\ud654 Hook \uc989, Custom Hook\uc740 \ucef4\ud3ec\ub10c\ud2b8 \uc0ac\uc774\uc5d0\uc11c \uacf5\ud1b5\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 \ub85c\uc9c1\uc744 \uc7ac\uc0ac\uc6a9\ud560 \ub54c \uc0ac\uc6a9\ud558\ub294 hook\uc73c\ub85c  \\n\uc0dd\ud0dc \uad00\ub828 \ub85c\uc9c1\uc744 \uc7ac\uc0ac\uc6a9\ud558\ub294 \ubc29\ubc95\uc785\ub2c8\ub2e4.  \\n\\n\uae00\uc758 \ub0b4\uc6a9\ubcf4\ub2e4\ub294 \uc9c1\uc811 \ubcf4\uace0 \uc774\ud574\ud558\ub294 \uac83\uc774 \ub354 \ube60\ub97c \uac83 \uac19\uc544 \uc608\uc2dc\ub85c \ub9cc\ub4e0, \ud68c\uc6d0\uac00\uc785\uc5d0\uc11c Custom Hook\uc744 \uc0ac\uc6a9\ud558\ub294 \ub0b4\uc6a9\uc744 \ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\n\\nReact \uacf5\uc2dd\ubb38\uc11c\uc5d0 \ub530\ub974\uba74, \\n- React \uc0ac\uc6a9\uc790\ud654 Hook\uc740 \uae30\ub2a5\ubcf4\ub2e4\ub294 \uaddc\uce59\uc5d0 \uac00\uae5d\ub2e4\uace0 \ud558\uace0\uc788\uc2b5\ub2c8\ub2e4.\\n- \uc774\ub984 \uc55e\uc5d0 use\ub97c \uc0ac\uc6a9\ud558\uace0, \ub0b4\ubd80\uc5d0 Hook\uc744 \uc0ac\uc6a9\ud55c\ub2e4\uba74, \uc0ac\uc6a9\uc790\ud654 \ud6c5\uc774\ub77c\uace0 \uc815\uc758\ud55c\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n \\n## Custom Hook \ub9cc\ub4e4\uae30\\n\\n**\ubaa9\ud45c**\\n\\n- input \ubcc0\ud654\uc5d0 \ub530\ub978 state \ub370\uc774\ud130\ub97c \ubc14\uc778\ub529 Custom Hook\uc73c\ub85c \ub9cc\ub4e4\uae30\\n- useCallBack, useMemo \uc7ac\ud65c\uc6a9\uc131\uc744 \ub192\uc740 \ucef4\ud3ec\ub10c\ud2b8 \ub9cc\ub4e4\uae30\\n\\n\\n\\n### input Tag\uc5d0\uc11c \uacf5\ud1b5\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 \ub85c\uc9c1 \uad6c\ubd84\ud558\uae30\\n\\n**\uacf5\ud1b5\ub85c\uc9c1**\\n\\n- input\uc758 onChage Event \ubc1c\uc0dd \uc2dc state\uc758 \uc774\uba54\uc77c, \ube44\ubc00\ubc88\ud638 , \uc774\ub984\uc744 \ubc14\uc778\ub529\ud55c\ub2e4.\\n- \ub3c5\ub9bd\uc801\uc778 state\uc774\uae30 \ub54c\ubb38\uc5d0, \ucd08\uae30\ud654\ub85c \uc0ac\uc6a9\ub418\ub294 \uc0ac\uc6a9\uc790 \uac12\uacfc, onChage, state\ub97c \ucd08\uae30\ud654\ud558\ub294 resest callback \ud568\uc218\ub97c \ub9ac\ud134\ud55c\ub2e4.\\n\\n\\n```js\\nimport { User } from \\"./../models/UserModel\\";\\nimport React, { useCallback, useState } from \\"react\\";\\n\\nconst useInput = (\\n  initValue: Partial<User>\\n): [\\n  Partial<User>,\\n  (e: React.ChangeEvent<HTMLInputElement>) => void,\\n  () => void\\n] => {\\n  const [value, setValue] = useState(initValue);\\n  const onChange = useCallback((e: React.ChangeEvent<HTMLInputElement>) => {\\n    const { name, value } = e.currentTarget;\\n\\n    setValue((prev) => ({ ...prev, [name]: value }));\\n  }, []);\\n\\n  const reset = () => {\\n    setValue(initValue);\\n  };\\n\\n  return [value, onChange, reset];\\n};\\n\\nexport default useInput;\\n\\n```\\n\\n1. useState\ub97c \uc0ac\uc6a9\ud558\uc5ec, User \uac1d\uccb4\ub97c \ucd08\uae30\ud654 \ud558\uace0.\\n2. onChange \uc774\ubca4\ud2b8\uc640 \ubcc0\ud654\uc5d0 \ub530\ub978 input \uac12\uc744 \ubc1b\uc2b5\ub2c8\ub2e4.\\n3. onChange useCallback\uc744 \uc0ac\uc6a9\ud558\uc5ec, input name\uc5d0 \ub9de\ub294 \uac1d\uccb4\ub97c return \ud558\uac8c \ud569\ub2c8\ub2e4. \\n4. User \ub4f1\ub85d \uc2dc, \uc0c1\ud0dc\uac12 \ucd08\uae30\ud654\ub97c \uc704\ud55c reset \uba54\uc18c\ub4dc\ub3c4 \uac19\uc774 \ub9ac\ud134\ud569\ub2c8\ub2e4.\\n\\n\\n\\n### \ud68c\uc6d0\uac00\uc785 \ud398\uc774\uc9c0\uc5d0\uc11c Custom Hook \uc0ac\uc6a9\ud558\uae30\\n- useInput Hook\uc744 \uc120\uc5b8\ud558\uc5ec  user state, onChange, reset\uc744 \ub9ac\ud134 \ubc1b\uc2b5\ub2c8\ub2e4. \\n- \ud68c\uc6d0\uac00\uc785 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 onCreate, onChange\ub97c Props\ub85c \uc804\ub2ec \ud558\uc5ec \uc0ac\uc6a9\ud569\ub2c8\ub2e4.\\n\\n```js\\nimport React, { useCallback, useReducer } from \\"react\\";\\nimport RegistUser from \\"../components/RegistUser\\";\\nimport UserList from \\"../components/UserList\\";\\nimport useInput from \\"../hooks/useInput\\";\\nimport { User } from \\"../models/UserModel\\";\\n\\ninterface PayloadAction {\\n  type: string;\\n  paylaod: User;\\n}\\n\\nfunction reducer(state: Array<User>, action: PayloadAction) {\\n  switch (action.type) {\\n    case \\"Create\\":\\n      return [...state, action.paylaod];\\n    default:\\n      return state;\\n  }\\n}\\n\\nexport default function RegisterPage() {\\n  const [{ email, password, name }, onChange, reset] = useInput({\\n    email: \\"\\",\\n    password: \\"\\",\\n    name: \\"\\",\\n  });\\n\\n  const [state, dispatch] = useReducer(reducer, []);\\n  const idx = state.length;\\n\\n  const onCreate = useCallback(() => {\\n    if (!email || !name || !password) return;\\n    dispatch({\\n      type: \\"Create\\",\\n      paylaod: { idx: idx + 1, email, name, password },\\n    });\\n\\n    reset();\\n  }, [email, password, name]);\\n\\n  return (\\n    <div>\\n      <RegistUser onChange={onChange} onCreate={onCreate} />\\n      <UserList userlist={state} />\\n    </div>\\n  );\\n}\\n\\n```\\n\\n### \ud68c\uc6d0\uac00\uc785 Component\uc5d0 \uc801\uc6a9\ud558\uae30\\n\\nCustom Hook\uc744 \uc774\uc81c \ud68c\uc6d0 \uac00\uc785 Component\uc5d0 \uc801\uc6a9\ud558\uaca0\uc2b5\ub2c8\ub2e4.  \\n\\n- input\uc740 \uc0c1\ud0dc\uac12\uacfc \uc774\ub984\uc744 \uac19\uc5d0\uac00 \ud558\uc5ec, Custom Hook\uc5d0\uc11c \uad6c\ubcc4 \ud560 \uc218 \uc788\ub3c4\ub85d \uc124\uc815\ud569\ub2c8\ub2e4.\\n- props\ub85c onChange \uc774\ubca4\ud2b8\uc640, page\uc5d0\uc11c \uc120\uc5b8\ud55c onCreate\ub97c \ud568\uc218\ub97c \ubc1b\uc544 \uc801\uc6a9\ud569\ub2c8\ub2e4.\\n\\n```js\\nimport React, { ChangeEvent } from \\"react\\";\\n\\ninterface RegistUserProps {\\n  onChange: (e: React.ChangeEvent<HTMLInputElement>) => void;\\n  onCreate: () => void;\\n}\\n\\nexport default function RegistUser({ onChange, onCreate }: RegistUserProps) {\\n  return (\\n    <div>\\n      <label htmlFor=\\"#\\">email</label>\\n      <input\\n        name=\\"email\\"\\n        type=\\"text\\"\\n        onChange={onChange}\\n      />\\n      <label htmlFor=\\"#\\">\ube44\ubc00\ubc88\ud638</label>\\n      <input\\n        name=\\"password\\"\\n        type=\\"text\\"\\n        onChange={onChange}\\n      />\\n      <label htmlFor=\\"#\\">\uc774\ub984</label>\\n      <input\\n        name=\\"name\\"\\n        type=\\"text\\"\\n        onChange={onChange}\\n      />\\n      <button onClick={onCreate}>\\n        \ud68c\uc6d0 \uac00\uc785\\n      </button>\\n    </div>\\n  );\\n}\\n```\\n\\n\\n---\\n\\n\uc774\ub807\uac8c input\uc5d0 onChange\uc5d0 \ub530\ub978 \uc0c1\ud0dc \uac12\uc5d0 \ub530\ub77c, state\uac00 \ubcc0\uacbd\ub418\ub294 \uacf5\ud1b5\ub85c\uc9c1\uc744 Custom Hook\uc744 \uac1c\ubc1c\ud558\uc5ec \ubcc0\uacbd\ud574\ubcf4\uc558\uc2b5\ub2c8\ub2e4.  \\n\uc774\uc81c \uc815\ub9d0... \uc2e4\uc81c \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc801\uc6a9\ud574\ubd10\uc57c \uaca0\uc2b5\ub2c8\ub2e4!!!  \\n\\n\\n\\n\\n**\ucc38\uc870**\\n- [React Document](https://ko.reactjs.org/docs/hooks-overview.html#building-your-own-hooks)"},{"id":"webpack","metadata":{"permalink":"/devlog/blog/webpack","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-20-Webpack.md","source":"@site/blog/2022-12-20-Webpack.md","title":"Webpack Project","description":"How to use Webpack","date":"2022-12-20T00:00:00.000Z","formattedDate":"2022\ub144 12\uc6d4 20\uc77c","tags":[{"label":"webpack","permalink":"/devlog/blog/tags/webpack"},{"label":"Vue","permalink":"/devlog/blog/tags/vue"},{"label":"Vue.js","permalink":"/devlog/blog/tags/vue-js"}],"readingTime":8.965,"hasTruncateMarker":true,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"title":"Webpack Project","description":"How to use Webpack","slug":"webpack","authors":"june","tags":["webpack","Vue","Vue.js"]},"prevItem":{"title":"CustomHook","permalink":"/devlog/blog/2022/12/21/CustomHook"},"nextItem":{"title":"Vue \uc2dc\uc791\ud558\uae30","permalink":"/devlog/blog/Vue"}},"content":"---\\n \\nReact, Vue\ub97c \uacf5\ubd80\ud558\uba74\uc11c cli\uc5d0 \uc758\uc874\ud558\ub294 \uacbd\ud5a5\uc774 \uc0dd\uaca8,   \\n\uc790\uc2e0\uc5d0 \ub9de\ub294 \ubc88\ub4e4\ub7ec\ub97c \uc124\uc815\ud558\uace0 \ub9cc\ub4dc\ub294 \ubc95\uc744 \ubc30\uc6cc\uc57c \uaca0\ub2e4\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4.  \\n\uc2e4\uc81c \uac00\ubcbc\uc6b4 \ud504\ub85c\uc81d\ud2b8\ub294 cli, \ud504\ub808\uc784\uc6cc\ud06c\ub97c \uc0ac\uc6a9\ud574\ub3c4 \ubb38\uc81c\uac00 \uc5c6\ub2e4\uace0\ub294 \ud558\uc9c0\ub9cc,  \\n\uae30\uc5c5\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 lint \uaddc\uce59, build \ub0b4\uc6a9\uc751 \ub2e4 \ub2e4\ub974\ub2e4\uace0 \ud569\ub2c8\ub2e4.  \\n\uac1c\uc778 \ud504\ub85c\uc81d\ud2b8\ub294 \ud55c\uacc4\uac00 \uc788\uace0, \ud611\uc5c5\uc5d0\uc11c \uc815\uaddc\ud654\ub41c \ucf54\ub4dc, \ubc84\uc804\uad00\ub9ac, \uc0ac\uc6a9 \ubaa8\ub4c8 \uad00\ub9ac\ub97c \uc704\ud574\uc11c\ub77c\ub3c4 webpack \ud639\uc73c Parcel\uc744 \uc0ac\uc6a9\ud574\uc11c \ud504\ub85c\uc81d\ud2b8\ub97c \uad6c\uc131\ud569\ub2c8\ub2e4.  \\n\uc624\ub298\uc740 \uae30\ubcf8\uc801\uc778 Webpack\uc744 \uc0ac\uc6a9\ud574\uc11c, \uc6f9 \ud504\ub85c\uc81d\ud2b8, vue \ud504\ub85c\uc81d\ud2b8\ub97c \ub9cc\ub4e4\uc5b4 boilpate \ucf54\ub4dc\ub85c git hub\uc5d0 \uc5c5\ub85c\ub4dc \ud558\ub294 \ub0b4\uc6a9\uc744 \uc791\uc131\ud558\ub824\uace0 \ud569\ub2c8\ub2e4.  \\n\\n# Webpack\uc774\ub780?\\nWebpack\uc740 \ubc88\ub4e4\ub7ec\ub77c\uace0\ub3c4 \ud569\ub2c8\ub2e4. \uc5ec\ub7ec\uac00\uc9c0\uc758 js \ud30c\uc77c\uc744 \ud558\ub098\ub85c \ubb36\uc5b4\uc8fc\uace0, \ud50c\ub7ec\uadf8\uc778\uc744 \uc774\uc6a9\ud574\uc11c html, css\uc744 \uc77d\uc5b4 \ud30c\uc77c\uc744 \ud574\uc11d\ud558\uace0 \uc0dd\uc131\ud558\ub294 \ubc88\ub4e4\ub7ec \uc785\ub2c8\ub2e4.\\n\\n- Node.js \ud658\uacbd\uc5d0\uc11c \uc2e4\ud589\ub429\ub2c8\ub2e4.\\n- webpack.config.js \ud30c\uc77c\uc5d0 \ud544\uc694 \uc124\uc815 \ubc0f \ud50c\ub7ec\uadf8\uc778\uc744 \uc815\uc758\ud569\ub2c8\ub2e4.\\n- babel, lint, output file, \ub4f1 \ud504\ub85c\uc81d\ud2b8\uc5d0 \ub9de\ucdb0 \uc124\uc815\ud558\uc5ec \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## Webpack\uc758 \uc2dc\uc791 Node \uc124\uce58 \ubc0f Webpack \ubaa8\ub4c8 \uc124\uce58\\n\\nWebpack\uc758 \ud658\uacbd\uc740 Node.js\ud658\uacbd\uc5d0\uc11c \uc774\ub8e8\uc5b4\uc9d1\ub2c8\ub2e4. [Node.js](https://nodejs.org/en/) \uc0ac\uc774\ud2b8\uc5d0 \uc811\uc18d\ud558\uc5ec \ub2e4\uc6b4\ub85c\ub4dc \ud569\ub2c8\ub2e4.  \\nNode.js \uc124\uce58\uac00 \uc644\ub8cc\ub418\uc5c8\uc73c\uba74, \ud130\ubbf8\ub110\uc5d0\uc11c version\uc744 \ud655\uc778\ud569\ub2c8\ub2e4.\\n\\n**Node.js \uc124\uce58**\\n\\n```bash\\n$ node -v\\n\\n16.14.2\\n```\\n\\n**\ud504\ub85c\uc81d\ud2b8 \ub9cc\ub4e4\uae30** \\n```bash\\n# \ud504\ub85c\uc81d\ud2b8 \ud3f4\ub354 \uc0dd\uc131 \\n$mkdir projectName\\n\\n# \ud3f4\ub354 \uc774\ub3d9\\n$cd projectName\\n\\n# npm \ud658\uacbd \ub9cc\ub4e4\uae30\\n$npm init -y\\n```\\n\uc774\uc81c Webpack\uc744 \uc2e4\ud589 \uc2dc\ucf1c\uc8fc\uace0 \ud14c\uc2a4\ud2b8 \ud658\uacbd\uc744 \ub9cc\ub4e4 \uc218 \uc788\ub294 package\ub97c \ub2e4\uc6b4\ub85c\ub4dc \ubc1b\uc2b5\ub2c8\ub2e4.\\n\\n```bash\\n# \ubc88\ub4e4\ub7ec\ub97c \uc2e4\ud589\ud558\uae30 \uc704\ud55c package\\n$npm i -D webpack\\n\\n# webpack command-line-interface\\n$npm i -D webpack-cli\\n\\n# webpack \uac1c\ubc1c\uc11c\ubc84\ub97c \uc2e4\ud589\ud558\uae30 \uc704\ud55c package cli \ubc84\uc804\uacfc \ub9de\ucdb0\uc57c\ud558\uae30 \ub54c\ubb34\uc5d0 @next\ub85c \ucd5c\uc2e0\ubc84\uc804\uc744 \ub2e4\uc6b4\ub85c\ub4dc \ubc1b\uc2b5\ub2c8\ub2e4.\\n$npm i -D webpack-dev-server@next\\n```\\n\\n**\uae30\ubcf8 \ud3f4\ub354 \uad6c\uc870 \ubc0f \ud30c\uc77c \ub9cc\ub4e4\uae30**\\n\\n```txt\\n- src \\n  - assets\\n  - main.js\\n  - index.html\\npackage.json\\npackage-lock.json\\nwebpack.config.js\\n```\\n  - src : web \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uc18c\uc2a4 \ucf54\ub4dc\ub97c \uc791\uc131\ud569\ub2c8\ub2e4.\\n  - assets : \uc774\ubbf8\uc9c0 \ud30c\uc77c, \uc544\uc774\ucf58\uc744 \uc800\uc7a5\ud558\ub294 \ud3f4\ub354\uc785\ub2c8\ub2e4. (\uc704\uce58\ub294 \uac1c\ubc1c\uc790 \ub9c8\ub2e4 \ub2e4\ub974\uac8c \uc124\uc815\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.)\\n  - package.json : \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \ud544\uc694\ud55c \ubaa8\ub4c8 \ubc0f \uc2e4\ud589 \uc2a4\ud06c\ub9bd\ud2b8, \ud504\ub85c\uc81d\ud2b8 \uc124\uc815\uc744 \uc791\uc131\ud569\ub2c8\ub2e4.\\n  - package-lock.json : \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub4e4\uc774 \ucc38\uc870\ud558\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub4e4\uc774 \uc815\uc758 \ub418\uc5b4\uc788\uc2b5\ub2c8\ub2e4.\\n  - webpack.config.json : webpack \ubc88\ub4e4\ub7ec\uac00 \uc0ac\uc6a9\ud558\ub294 \ud50c\ub7ec\uadf8\uc778, webpack\uc5d0 \ub300\ud55c \uc124\uc815\uc744 \uc791\uc131\ud569\ub2c8\ub2e4.\\n\\n\\n**\uae30\ubcf8 Webpack config \uc124\uc815**\\n\\n\\n```js\\n// webpack.config.js\\n\\nconst path = require(\'path\')\\nconst CopyPlugin = require(\'copy-webpack-plugin\')\\nconst HtmlPlugin = require(\'html-webpack-plugin\')\\n\\nmodule.exports = {\\n  entry: \'./src/main.js\',\\n  output: {\\n    publicPath: \'/\',\\n    clean: true  \\n  },\\n  module: {\\n    rules: [\\n      {\\n        test: /\\\\\uc815\uaddc\uc2dd$/,\\n        use: [...moduleList],\\n      }\\n    ]\\n  },\\n  plugins: [\\n     new HtmlPlugin({\\n      template: \'./src/index.html\' // \ubc88\ub4e4\ub9c1\uc2dc, \uc0ac\uc6a9\ud560 html\uc758 \uc124\uc815\\n    }),\\n    new CopyPlugin({ // \ud30c\uc77c\uc774 \ubcf5\uc0ac \ub418\ub294 \uacbd\ub85c\ub97c \ub9d0\ud55c\ub2e4.\\n      patterns: [\\n        { from: \'./src/assets\' }\\n      ]\\n    })\\n   ],\\n  devServer: {\\n    host: \'localhost\'\\n  }\\n}\\n```\\n- entry : webpack\uc774 \ub9e8\ucc98\uc74c \uc77d\uc5b4\uc57c\ud558\ub294 \ud30c\uc77c\uc744 \uc124\uc815\ud569\ub2c8\ub2e4.\\n- output : \ube4c\ub4dc\ub418\ub294 \ud30c\uc77c \uc124\uc815\ud569\ub2c8\ub2e4.(\ud3f4\ub354\uac00 \uc120\uc5b8\ub418\uc5b4\uc788\uc9c0 \uc54a\uc73c\uba74 \uc790\ub3d9\uc73c\ub85c dist \ud3f4\ub354\ub85c \uace0\uc815\ud569\ub2c8\ub2e4.)\\n  - publicPath: \uacf5\ud1b5\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 \ud30c\uc77c \uacbd\ub85c\ub97c \uc124\uc815\ud569\ub2c8\ub2e4. \\n  - clean : \uae30\uc874\uc758 \ube4c\ub4dc\ud55c \ud30c\uc77c\ub4e4\uc744 \uc0ad\uc81c\ud558\uace0 \ub2e4\uc2dc \uc0dd\uc131\ud558\ub294 option\uc785\ub2c8\ub2e4.\\n- module : webpack\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ubaa8\ub4c8\uc758 \uc0ac\uc6a9 \ub0b4\uc6a9\uc744 \uc124\uc815\ud569\ub2c8\ub2e4.\\n  - rules : \uc0ac\uc6a9\ud558\ub294 \ubaa8\ub4c8\uc774 \ucc38\uc870\ud558\ub294 \ubc29\uc2dd\uc744 \ubc30\uc5f4\ub85c \uc815\uc758\ud569\ub2c8\ub2e4.\\n    - test :  \ubaa8\ub4c8\uc774 \ucc38\uc870\ud560 \ud30c\uc77c\uc744 \uc124\uc815\ud569\ub2c8\ub2e4.\\n    - use : \ucc38\uc870\ud558\ub294 \ud30c\uc77c\uc744 \uc0ac\uc6a9\ub418\ub294 \ubaa8\ub4c8 \uc21c\uc11c\ub97c \ubc30\uc5f4\ub85c \uc815\uc758\ud569\ub2c8\ub2e4(\uc5ed\uc21c\uc73c\ub85c \uc2e4\ud589)\\n- plugins : webpack\uc5d0 \ud544\uc694\ud55c plugin\uc744 \ubc30\uc5f4\uc758 \uc778\uc2a4\ud134\uc2a4 \ud615\uc2dd\uc73c\ub85c \uc815\uc758\ud569\ub2c8\ub2e4. \\n- devserver : \uac1c\ubc1c \uc11c\ubc84 \uc635\uc158\uc744 \uc815\uc758\ud569\ub2c8\ub2e4.\\n\\n---\\n\\nWeb\uc758 \uad6c\uc131\uc774 javascript\uac00 \ub2e4\uac00 \uc544\ub2c8\uc8e0, html,css\uc5d0 \ub300\ud55c \ubaa8\ub4c8\uc744 \uc801\uc6a9\ud574\uc57c\ud569\ub2c8\ub2e4. \\n\\n### CSS Loader \uc124\uce58\ud558\uae30\\n\\n```bash\\n# css \ud30c\uc77c\uc744 \uc77d\uc5b4 \uc62c \uc218 \uc788\uac8c \ub3c4\uc640\uc8fc\ub294 \ubaa8\ub4c8\\n$npm i -D css-loader\\n# \uc77d\uc740 css\ub97c \uc801\uc6a9\ud560 \uc218 \uc788\uac8c \ub3c4\uc640\uc8fc\ub294 \ud50c\ub7ec\uadf8\uc778\\n$npm i -D style-loader plugin\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc778\uc2a4\ud1a8 \uc774\ud6c4 \ub2e4\uc2dc webpack.config.js \ud30c\uc77c\uc5d0 \uc124\uc815\ud574\uc918\uc57c \ud569\ub2c8\ub2e4.\\n\\n```js\\n{\\n  rules: [\\n    {\\n      test: /\\\\.css$/,\\n      // \uc5ed\uc21c\uc73c\ub85c \uc2e4\ud589\\n      use: [\\n        \'style-loader\'\\n        \'css-loader\'\\n      ]\\n    }\\n  ]\\n}\\n```\\n\\n\\n### HTML Plugin \uc124\uc815\ud558\uae30\\n\\nHtml\uc744 \uc77d\uc5b4\uc11c \ube4c\ub4dc\ud558\uae30 \uc704\ud55c \ud50c\ub7ec\uadf8\uc778\uc744 \ub2e4\uc6b4 \ubc1b\uace0 \uc124\uc815\ud560 \uac83\uc785\ub2c8\ub2e4.  \\n\ucd94\uac00\uc801\uc73c\ub85c asssts \ud3f4\ub354\uc5d0\uc11c \ube4c\ub4dc\ud560 \ub54c, \uc774\ubbf8\uc9c0\ub97c \uc790\ub3d9\uc73c\ub85c \uc62e\uaca8\uc8fc\ub294 \ud50c\ub7ec\uadf8\uc778\ub3c4 \uac19\uc774 \uc124\uc815\ud560 \uac83 \uc785\ub2c8\ub2e4.\\n\\n```bash\\n$npm i -D html-webpack-plugin\\n$npm i -D copy-webpack-plugin\\n```\\n\\n__\uc124\uc815__\\n\\n```js\\n{\\n   plugins: [\\n     new HtmlPlugin({ template: \'./src/index.html\' // \ubc88\ub4e4\ub9c1\uc2dc, \uc0ac\uc6a9\ud560 html\uc758 \uc124\uc815 }),\\n    new CopyPlugin({ // \ud30c\uc77c\uc774 \ubcf5\uc0ac \ub418\ub294 \uacbd\ub85c\ub97c \ub9d0\ud55c\ub2e4.\\n      patterns: [\\n        { from: \'./src/assets\' }\\n      ]\\n    })\\n   ]\\n}\\n```\\n\\n### Babel \uc124\uc815\ud558\uae30 \\n\\nWeb \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \ud558\uc704 js \ubc84\uc804\uc73c\ub85c \ud638\ud658\uc774 \uac00\ub2a5\ud560 \uc218 \uc788\ub3c4\ub85d \ud558\ub294 babel\uc744 \ube7c\uc11c\ub294 \uc548\ub418\uaca0\uc8e0?\\n\uc774\uc81c babel\uc5d0 \ub300\ud55c \uc124\uc815\uc744 \ud558\uaca0\uc2b5\ub2c8\ub2e4. \\n\\n```bash\\n$npm i -D @babel/core \\n$npm i -D @babel/preset-env \\n$npm i -D @babel/plugin-transform-runtime\\n$npm i -D babel-loader\\n```\\n\\njs \ud30c\uc77c\uc744 \uc77d\uc5b4 \ucef4\ud30c\uc77c\ud558\uae30\ub54c\ubb38\uc5d0 webpack.config.js \ud30c\uc77c\uc5d0 \uc124\uc815\ud569\ub2c8\ub2e4.\\n```js\\n{\\n  module: {\\n    rules: [\\n         {\\n        // babel \uc801\uc6a9\ud558\ub294 \uc2dc\uc810\\n        test: /\\\\.js$/,\\n        use: [\\n          \'babel-loader\',\\n        ]\\n      }\\n    ]\\n  }\\n}\\n```\\n\\n\ucd94\uac00\uc801\uc73c\ub85c babel \ucef4\ud30c\uc77c\ub7ec\uac00 \uc0ac\uc6a9\ud558\ub294 \ubaa8\ub4c8\uc744 \uc124\uc815\ud574\uc918\uc57c\ud558\ub294\ub370\uc694.  \\nroot \uacbd\ub85c\uc5d0 .babelrc.js \ud30c\uc77c\uc744 \ub9cc\ub4e4\uace0 \uc544\ub798\uc640 \uac19\uc774 \uc124\uc815\ud574\uc90d\ub2c8\ub2e4. \\n\\n```js\\nmodule.exports = {\\n  presets: [\'@babel/preset-env\'], // \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8\ub97c \uae30\ub2a5\uc744 \uc9c0\uc6d0\ud558\ub294 \uae30\ub2a5\\n  plugins: [\\n    [\'@babel/plugin-transform-runtime\'] // \ube44\ub3d9\uae30 \ucc98\ub9ac\ub294 \uae30\ub2a5\uc744 \ud558\ub294 \ud50c\ub7ec\uadf8\uc778\\n  ]\\n}\\n```\\n\\n### sciprt \uc124\uc815\\n\uc774\uc81c package.json\uc5d0 sciprt\ub97c \uc791\uc131\ud574\uc11c build\uc640 \uac1c\ubc1c \uc11c\ubc84\ub97c test \ud574\ubd10\uc57c \ud569\ub2c8\ub2e4.  \\n\uc544\ub798\uc640 \uac19\uc774 script\ub97c \uc791\uc131\ud569\ub2c8\ub2e4.\\n\\n```json\\n{\\n  \\"scripts\\": {\\n    \\"dev\\": \\"webpack-dev-server --mode development\\",\\n    \\"build\\": \\"webpack --mode production\\"\\n  },\\n}\\n```\\n\\n```bash\\n# \uac1c\ubc1c \uc11c\ubc84 \uc2e4\ud589\\n$npm run dev\\n# \ud504\ub85c\uc81d\ud2b8 \ube4c\ub4dc\\n$npm run build\\n```\\n\\n \uc704\uc640 \uae49\uc774 \uc2e4\ud589 \ud588\uc744 \ub54c,  \uc815\uc0c1\uc801\uc73c\ub85c \uc791\ub3d9\ud558\uba74 \ud558\ub098\uc758 webpack\ub85c \uad6c\ud604 \ud560 \uc218 \uc788\ub294 \ud504\ub85c\uc81d\ud2b8\ub864   \\n \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\n\\n\uc774\uc81c \ucd94\uac00\uc801\uc73c\ub85c react, vue, scss \uc790\uc2e0\uc774 \uc0ac\uc6a9\ud558\uace0\uc790 \ud558\ub294 \ubaa8\ub4c8\uc744 \uc124\uc815\ud558\uace0 \ud504\ub85c\uc81d\ud2b8\ub97c \uc124\uc815 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.  \\n\\n\ub9e8\ucc98\uc74c\uc5d0\ub294 \uc5b4\ub835\ub2e4\uace0 \uc0dd\uac01\ud588\ub294\ub370 \uc790\uc2e0\ub9cc\uc5d0 \uc124\uc815\uc744 \ud558\ub2c8\uae50 \uc870\uae08\uc529 \uc131\ucde8\uac10\uc774 \uc0dd\uae30\ub294 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n\ub2e4\uc74c\uc5d0\ub294 Vue\ub791 React \ud504\ub85c\uc81d\ud2b8\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc0ac\uc6a9\ud560 \uc608\uc815\uc785\ub2c8\ub2e4.  \\ngithub\ub97c \ud1b5\ud574\uc11c \ubbf8\ub9ac \uae30\ubcf8 webpack\uc744 \uc0ac\uc6a9\ud55c\ub2e4\uba74 \uc5b8\uc81c\ub4e0 \uc790\uc2e0\ub9cc\uc758 \ud504\ub85c\uc81d\ud2b8\ub97c \ub9cc\ub4e4 \uc218 \uc788\uc744 \uac83 \uac19\uc2b5\ub2c8\ub2e4."},{"id":"Vue","metadata":{"permalink":"/devlog/blog/Vue","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-17-VueStart.md","source":"@site/blog/2022-12-17-VueStart.md","title":"Vue \uc2dc\uc791\ud558\uae30","description":"Vue Start day1","date":"2022-12-17T00:00:00.000Z","formattedDate":"2022\ub144 12\uc6d4 17\uc77c","tags":[{"label":"Vue","permalink":"/devlog/blog/tags/vue"},{"label":"FrontEnd","permalink":"/devlog/blog/tags/front-end"},{"label":"Vue.js","permalink":"/devlog/blog/tags/vue-js"}],"readingTime":6.005,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"title":"Vue \uc2dc\uc791\ud558\uae30","description":"Vue Start day1","slug":"Vue","authors":"june","tags":["Vue","FrontEnd","Vue.js"]},"prevItem":{"title":"Webpack Project","permalink":"/devlog/blog/webpack"},"nextItem":{"title":"React\uc758 Hook\uc774\ub780?","permalink":"/devlog/blog/ReactHook"}},"content":"---\\n\\nReact\ub97c \uacf5\ubd80\ud558\uba74\uc11c \ud558\ub098\uc758 \ud504\ub808\uc784\uc6cc\ud06c\ub9cc \uacf5\ubd80\ud558\uae30 \ubcf4\ub2e4\ub294 \uc5ec\ub7ec\uac00\uc9c0\uc758 \ud504\ub808\uc784 \uc6cc\ud06c\ub97c \ud1b5\ud574\uc11c  \\n\uae30\uc220\uc801\uc778 \ub2a5\ub825\uc744 \uae30\ub974\uace0\uc2f6\uc5b4\uc11c Vue\ub97c \uacf5\ubd80 \uc77c\uc9c0\ub97c \uc791\uc131\ud558\ub824\uace0 \ud569\ub2c8\ub2e4.  \\n\\nVue\uac00 \ubb34\uc5c7\uc774\uace0, \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uc9c0 \uc5b4\ub5a4 \uc774\uc810\uc774 \uc788\ub294\uc9c0 \ucc28\uadfc\ucc28\uadfc \ubc30\uc6cc\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.  \\n\\n# Vue? \\n\\nVue\ub294 \uacf5\uc2dd \uc0ac\uc774\ud2b8\uc5d0\uc11c \uc18c\uac1c\ud558\uae30\ub97c, \uc0ac\uc6a9\uc790 \uc778\ud130\ud398\uc774\uc2a4\ub97c \uc81c\uacf5\ud558\uae30 \uc704\ud55c Javascript \ud504\ub808\uc784\uc6cc\ud06c\ub77c\uace0 \ud569\ub2c8\ub2e4.  \\n\uae30\ubcf8\uc801\uc778 HTML, CSS, Javascript\ub97c \uc81c\uacf5\ud558\uc5ec \ucef4\ud3ec\ub10c\ud2b8 \ub2e8\uc704\ub85c \uc720\uc800 \uc778\ud130\ud398\uc774\uc2a4\ub97c \uc81c\uacf5\ud558\ub294 \ud504\ub808\uc784\uc6cc\ud06c\uc785\ub2c8\ub2e4.\\n\\n\\n## Vue\uc758 \ud2b9\uc131\\n\\n\\n- Declarative Rendering: Vue extends standard HTML with a template syntax that allows us to declaratively\\ndescribe HTML output based on JavaScript state.\\n\\n- Reactivity: Vue automatically tracks JavaScript state changes and efficiently updates the DOM when changes happen.\\n\\n\uacf5\uc2dd \uc0ac\uc774\ud2b8\uc5d0 \ub9d0\ud558\ub294 2\uac00\uc9c0 \ud2b9\uc131\uc774 \uc788\uc2b5\ub2c8\ub2e4. \\n\\n- \uc120\uc5b8\uc801\uc778 \ub80c\ub354\ub9c1 \ubc29\uc2dd: Javascript\uc5d0 \ub530\ub978 html\uc744 \uc120\uc5b8\uc801\uc73c\ub85c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub294 \ud2b9\uc131\uc774 \uc788\uc2b5\ub2c8\ub2e4.  \\nHTML, Javascript, CSS\ub97c \uc120\uc5b8\uc744 \uad6c\ubd84\ud558\uc5ec, Javascript\uc5d0 \ub530\ub978 \ub3d9\uc801\uc73c\ub85c HTML\uc744 \uad6c\ud604 \ud560 \uc218 \uc788\ub294 \ud2b9\uc131\uc785\ub2c8\ub2e4.\\n\\n- \uc720\uc5f0\uc131: Vue\ub294 \uc790\ub3d9\uc801\uc73c\ub85c Javascript\uc758 \uc0c1\ud0dc\uc5d0 \ub530\ub978 \ubcc0\ud654\ub97c \ud6a8\uacfc\uc801\uc73c\ub85c \uc5c5\ub370\uc774\ud2b8 \ud569\ub2c8\ub2e4.\\n\\n\\n\uadf8\ub9ac\uace0 \uc774\ub7ec\ud55c \ud2b9\uc131\uc744 \uac00\uc9c0\uace0 2\uac00\uc9c0\uc758 API\ub97c \uc81c\uacf5\ud569\ub2c8\ub2e4.  \\n\uc81c\uac00 \uc774\ud574\ud558\uae30\ub85c\ub294 API\uc758 \ub0b4\uc6a9\uc740 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294, State\uc758 \uad00\ub9ac \ubc29\uc2dd\uc744 \ub9d0\ud558\ub294 \uac83 \uac19\uc2b5\ub2c8\ub2e4 \\n\\n### Option API vs Composition API\\n\\n- Option API : script\ub0b4\ubd80\uc5d0  data, method, lifecycle hook\uc744 \uad6c\ubd84\ud558\uace0, \uc120\uc5b8\ud558\uc5ec \uac01\uac01 \uc870\uac74\uc5d0 \ub9de\ub294 \uc0ac\uc6a9 \ubc29\uc2dd\uc744 \uac00\uc9c0\uace0 \uc815\uc758\ud569\ub2c8\ub2e4.\\n- Composition API :   \\n  - import\ud55c API \ud568\uc218\ub97c \uc0ac\uc6a9\ud558\uc5ec \ucef4\ud3ec\ub10c\ud2b8 \ub85c\uc9c1\uc744 \uc815\uc758\ud569\ub2c8\ub2e4.\\n  - script setup \uc18d\uc131\uc744 \uac00\uc9c0\uace0, composition API\ub97c \uc0ac\uc6a9\ud558\uace0 \ub85c\uc9c1\uc801\uc778 \ubd80\ubd84\uc744 \uc880 \ub354 \uac04\uacb0\ud558\uac8c \uc0ac\uc6a9 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n**Option API**\\n```js\\n<script>\\nexport default {\\n  // data()\uc5d0\uc11c \ubc18\ud658\ub41c \uc18d\uc131\ub4e4\uc740 \ubc18\uc751\uc801\uc778 \uc0c1\ud0dc\uac00 \ub418\uc5b4 `this`\uc5d0 \ub178\ucd9c\ub429\ub2c8\ub2e4.\\n  data() {\\n    return {\\n      count: 0\\n    }\\n  },\\n\\n  // methods\ub294 \uc18d\uc131 \uac12\uc744 \ubcc0\uacbd\ud558\uace0 \uc5c5\ub370\uc774\ud2b8 \ud560 \uc218 \uc788\ub294 \ud568\uc218.\\n  // \ud15c\ud50c\ub9bf \ub0b4\uc5d0\uc11c \uc774\ubca4\ud2b8 \ub9ac\uc2a4\ub108\ub85c \ubc14\uc778\ub529 \ub420 \uc218 \uc788\uc74c.\\n  methods: {\\n    increment() {\\n      this.count++\\n    }\\n  },\\n\\n  // \uc0dd\uba85\uc8fc\uae30 \ud6c5(Lifecycle hooks)\uc740 \ucef4\ud3ec\ub10c\ud2b8 \uc0dd\uba85\uc8fc\uae30\uc758 \uc5ec\ub7ec \ub2e8\uacc4\uc5d0\uc11c \ud638\ucd9c\ub429\ub2c8\ub2e4.\\n  // \uc774 \ud568\uc218\ub294 \ucef4\ud3ec\ub10c\ud2b8\uac00 \ub9c8\uc6b4\ud2b8 \ub41c \ud6c4 \ud638\ucd9c\ub429\ub2c8\ub2e4.\\n  mounted() {\\n    console.log(`\uc22b\uc790 \uc138\uae30\uc758 \ucd08\uae30\uac12\uc740 ${ this.count } \uc785\ub2c8\ub2e4.`)\\n  }\\n}\\n<\/script>\\n\\n<template>\\n  <button @click=\\"increment\\">\uc22b\uc790 \uc138\uae30: {{ count }}</button>\\n</template>\\n```\\n\\n**Composition API**\\n```js\\n<script setup>\\nimport { ref, onMounted } from \'vue\'\\n\\n// \ubc18\uc751\uc801\uc778 \uc0c1\ud0dc\uc758 \uc18d\uc131\\nconst count = ref(0)\\n\\n// \uc18d\uc131 \uac12\uc744 \ubcc0\uacbd\ud558\uace0 \uc5c5\ub370\uc774\ud2b8 \ud560 \uc218 \uc788\ub294 \ud568\uc218.\\nfunction increment() {\\n  count.value++\\n}\\n\\n// \uc0dd\uba85 \uc8fc\uae30 \ud6c5\\nonMounted(() => {\\n  console.log(`\uc22b\uc790 \uc138\uae30\uc758 \ucd08\uae30\uac12\uc740 ${ count.value } \uc785\ub2c8\ub2e4.`)\\n})\\n<\/script>\\n\\n<template>\\n  <button @click=\\"increment\\">\uc22b\uc790 \uc138\uae30: {{ count }}</button>\\n</template>\\n```\\n\\n## Vue \ud504\ub85c\uc81d\ud2b8 \uc124\uce58 \ubc0f \uc0dd\uc131\ud558\uae30\\n\\n- Node.js\ub97c \ud1b5\ud574\uc11c Vue \ud504\ub85c\uc81d\ud2b8\ub97c \uc0dd\uc131\ud558\ub294 \uba85\ub839 \ubb38\uc785\ub2c8\ub2e4.\\n\\n```bash\\n$ npm init @vue/latest\\n```\\n\\n- Vue & Vue cli\ub97c \uc124\uce58\ud558\uc5ec \uc0dd\uc131\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\n  -  Vue cli\ub294 vue \ud504\ub85c\uc81d\ud2b8 \uc0dd\uc131 \ubc0f \ube4c\ub4dc, \ubc30\ud3ec\uae4c\uc9c0 \uc9c0\uc6d0\ud574\uc8fc\ub294 \ub3c4\uad6c\uc785\ub2c8\ub2e4.\\n\\n```bash\\n# Vue\ub97c \uc778\uc2a4\ud1a8\ud569\ub2c8\ub2e4.\\n$ npm i -g vue\\n\\n# Vue cli install\\n$ npm i -g @vue/cli\\n\\n# create vue propject\\n$ vue create projectName\\n```\\n\\n\\n- CDN\uc744 \ud1b5\ud55c \uc124\uce58\\n```html\\n<script src=\\"https://unpkg.com/vue@3/dist/vue.global.js\\"><\/script>\\n```\\n\\n\\n## Vue Project \uad6c\uc870 \ubc0f \uc124\uba85\\n\\n  <img width=\\"210\\" alt=\\"image\\" src=\\"https://user-images.githubusercontent.com/103201530/208240119-6e5ae9a2-62f6-47ed-afa1-2fa658995591.png\\"/>\\n\\n\uc800\ub294 Vue cli\ub85c \uc0dd\uc131\ud588\uae30 \ub54c\ubb38\uc5d0, vue/cli \uae30\uc900\uc73c\ub85c \uc124\uba85\ud558\uaca0\uc2b5\ub2c8\ub2e4.  \\n\\n- assets : \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uc774\ubbf8\uc9c0, \ud544\uc694 resource\ub97c \uc800\uc7a5\ud558\ub294 \ud3f4\ub354\\n- components : \uc791\uc740 \ucef4\ud3ec\ub10c\ud2b8 \ud30c\uc77c\uc744 \uc800\uc7a5\ud558\ub294 \ud3f4\ub354\\n- router : \ud654\uba74 \ud398\uc774\uc9c0 \uacbd\ub85c\uc5d0 \ub530\ub978 \ubcf4\uc5ec\uc904 \ud654\uba74\uc758 \uc124\uc815\uc744 \ud558\ub294 \ud3f4\ub354 \uc785\ub2c8\ub2e4.\\n- store : \uacf5\ud1b5\uc73c\ub85c \uc0ac\uc6a9\ud558\ub294 \uc0c1\ud0dc\uac12\uc744 \uc124\uc815\ud558\ub294 \ud3f4\ub354\uc785\ub2c8\ub2e4. \\n- views : \uc2e4\uc81c \uacbd\ub85c\uc5d0 \ub530\ub978 \ud398\uc774\uc9c0 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uad6c\ud604\ud558\ub294 \ud3f4\ub354\uc785\ub2c8\ub2e4.\\n- main.js : \ud504\ub85c\uc81d\ud2b8\uc758 \uc2dc\uc791 \uc9c0\uc810 \ud30c\uc77c \uc785\ub2c8\ub2e4.\\n\\n\\n### \uae30\ubcf8 \ud3f4\ub354\uad6c\uc870 \uc678 \ud30c\uc77c \\n- package.json : \ud504\ub85c\uc81d\ud2b8\uc758 \ud544\uc694\ud55c \ub77c\uc774\ube0c\ub7ec\ub9ac, \uc2e4\ud589 \uc2a4\ud06c\ub9bd\ud2b8, lint Convention(\ucf54\ub4dc \uaddc\uce59) option\uc744 \uc124\uc815\ud558\ub294 config \ud30c\uc77c\\n- babel.config.js : \uad6c\ubc84\uc804 Javascript \ucef4\ud30c\uc77c\ub7ec\uc778 babel\uc5d0 \ub300\ud55c \uc635\uc158 \ud30c\uc77c\\n- vue.config.js : \ud504\ub85c\uc81d\ud2b8 vue \uad00\ub828 config \ud30c\uc77c\\n\\n\uc774\ub807\uac8c \uac04\ub2e8\ud558\uac8c Vue \ud504\ub85c\uc81d\ud2b8\uc758 \uad6c\uc870 \ubc0f \uc124\uba85\uc744 \uc791\uc131\ud574\ubcf4\uc558\uc2b5\ub2c8\ub2e4.  \\n\uacf5\uc2dd \ubb38\uc11c\ub97c \ubcf4\uba74\uc11c \ub530\ub77c\uac00\uace0 \uc788\uc5b4 \uac19\uc774 \uc0ac\uc9c1\ud558\uc2dc\ub294 \ubd84\ub4e4\ud55c\ud14c \ub9ce\uc740 \ub3c4\uc6c0\uc774 \ub418\uc5c8\uc73c\uba74 \uc88b\uaca0\uc2b5\ub2c8\ub2e4."},{"id":"ReactHook","metadata":{"permalink":"/devlog/blog/ReactHook","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-15-ReactHook.md","source":"@site/blog/2022-12-15-ReactHook.md","title":"React\uc758 Hook\uc774\ub780?","description":"---","date":"2022-12-15T00:00:00.000Z","formattedDate":"2022\ub144 12\uc6d4 15\uc77c","tags":[{"label":"React","permalink":"/devlog/blog/tags/react"},{"label":"React-Hook","permalink":"/devlog/blog/tags/react-hook"},{"label":"FrontEnd","permalink":"/devlog/blog/tags/front-end"}],"readingTime":6.72,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"slug":"ReactHook","title":"React\uc758 Hook\uc774\ub780?","authors":"june","tags":["React","React-Hook","FrontEnd"]},"prevItem":{"title":"Vue \uc2dc\uc791\ud558\uae30","permalink":"/devlog/blog/Vue"},"nextItem":{"title":"Browser\ub294 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","permalink":"/devlog/blog/Browser"}},"content":"---\\n\\nReact Hook\uc5d0 \ub300\ud574\uc11c \uc815\ud655\ud55c \uac1c\ub150\uc744 \ud655\uc2e4\ud788 \uc7a1\uc744 \uc218 \uc788\ub294 \ucde8\uc9c0\uc5d0 \ube14\ub85c\uadf8 \uae00\uc785\ub2c8\ub2e4.\\n\\n# ReactHook \uc774\ub780? \\n\\nReactHook\uc740 \uacfc\uac70 React class type\uc5d0\uc11c Lifecyle\uc744 \ud568\uc218\ud615 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c\ub3c4 \uc0ac\uc6a9\ud558\uae30 \uc704\ud55c \ubc29\ubc95\uc5d0\uc11c \ub098\uc654\uc2b5\ub2c8\ub2e4.  \\n\ucef4\ud3ec\ub10c\ud2b8 \uc0ac\uc774\uc5d0 \ub85c\uc9c1 \uc7ac\ud65c\uc6a9\uc774 \uc5b4\ub824\uc6b4 \uc0c1\ud669\uc744 \ubcf4\uc548\ud558\uae30 \uc704\ud55c \ud568\uc218\uc785\ub2c8\ub2e4.  \\n\uac1c\uce35\uc758 \ubcc0\ud654\uc5c6\uc774 \uc0c1\ud0dc \uad00\ub828 \ub85c\uc9c1\uc744 \uc7ac\ud65c\uc6a9 \ud560 \uc218 \uc788\uac8c \ub3c4\uc640\uc8fc\ub294 \ud568\uc218\uc785\ub2c8\ub2e4.  \\n\\n\\n## Hook\uc758 \uc885\ub958\\n- useState\\n- useEffect\\n- useContext\\n- useReducer\\n- useCallBack\\n- useTransition\\n\\n## Hook\uc758 \uaddc\uce59 \\n- \ucd5c\uc0c1\uc704 \ub808\ubca8\uc5d0\uc11c\ub9cc hook\uc744 \uc694\uccad\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.(\ubc18\ubcf5\ubb38\uc774\ub098, \uc870\uac74\ubb38 \uc911\ucca9\ub41c \ud568\uc218\uc5d0\uc11c \ud638\ucd9c \ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.)\\n- React \ud568\uc218 \ucef4\ud3ec\ub10c\ud2b8\uc5d0\uc11c\ub9cc hook\uc744 \ud638\ucd9c \ud574\uc57c\ud569\ub2c8\ub2e4. \ub2e8, customHook \uc548\uc5d0\uc11c\ub294 \ud638\ucd9c \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\\n### useState\\nuseState\ub294 \uc0c1\ud0dc \uac12\uc744 \uc800\uc7a5\ud558\ub294 \ubcc0\uc218\ub85c \uc0ac\uc6a9\ud558\ub294 hook\uc785\ub2c8\ub2e4. \\nstate\uac12\uc744 \uc9c1\uc811 \ud560 \ub2f9 \ud560 \uc218 \uc5c6\uace0, useState\uc5d0 \uac19\uc774 \uc120\uc5b8\ub41c \ud568\uc218\ub97c \ud1b5\ud574\uc11c \uc218\uc815\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n- props\uc640 \uac19\uc774 \ubcc0\ub3d9\uc0ac\ud56d\uc774 \uc0dd\uae38 \ub54c, \ub2e4\uc2dc \ub9ac\ub80c\ub354\ub9c1 \ub429\ub2c8\ub2e4.\\n\\n```js\\nconst [count, setCount] = useState(0);\\n```\\n\\n\\n### useEffect\\nEffect\uc758 \ud6c5\uc758 \uc815\uc758\ub294 \ub370\uc774\ud130\ub97c \uac00\uc838\uc624\uac70\ub098 \uc0c1\ud0dc\uac12\uc5d0 \ub530\ub978 \ubd80\uc218\ud6a8\uacfc(side-effect)\ub97c \uc815\uc758\ud560 \uc218 \uc788\ub3c4\ub85d \ud558\ub294 hook \uc785\ub2c8\ub2e4.  \\nReact class\uc758 componentDidMount, componentDidUpdate,componentWillUnmount\uc758 \uac19\uc740 \ubaa9\uc801\uc73c\ub85c \ub9cc\ub4e0 hook\uc785\ub2c8\ub2e4.  \\n\\n**\ud2b9\uc131**\\n- EffectHook\uc740 DOM\uc5d0\uc11c \ub80c\ub354\ub9c1 \uc774\ud6c4\uc5d0 \ud638\ucd9c \ub429\ub2c8\ub2e4.\\n- EffectHook\uc740 return\uc744 \ud1b5\ud574\uc11c \ud574\uc81c \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n- \uc5ec\ub7ec\uac1c\uc758 effect hook\uc744 \uac00\uc9c8 \uc218 \uc788\uc2b5\ub2c8\ub2e4.(\uc0c1\ud0dc\uac12\uc5d0 \ub530\ub978 side Effect\ub97c \uc815\uc758 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.)\\n- useEffect Hook\uc740 lifeCycle\uc744 \ub300\uc2e0\ud574\uc11c, \uc0ac\uc6a9\ud558\ub294 Hook\uc774 \uc544\ub2d9\ub2c8\ub2e4.\\n  - \ubd80\uc218\ud6a8\uacfc, \ud639\uc740 \ub3d9\uae30\ud654 \uc791\uc5c5\uc744 \uc9c4\ud589\ud558\ub294 \ubd80\ubd84\uc785\ub2c8\ub2e4.\\n  - \ucef4\ud3ec\ub10c\ud2b8\uc758 \ub370\uc774\ud130\uc758 \ub3d9\uae30\ud654\uac00 \uc544\ub2cc \uc801\uc6a9, \ubcc0\ud654\uc5d0 \ub530\ub978 \ub0b4\uc6a9\uc740 useMemo, useCallBack\uc744 \uc0ac\uc6a9\ud574\uc11c \uc791\uc131\ud574\uc57c \ud569\ub2c8\ub2e4.\\n\\n\\n### useContext\\nuseContext\ub294 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc911\ucca9\ud558\uc9c0 \uc54a\uc544\ub3c4 React Context\ub97c \uad6c\ub3c5\ud558\uac8c \ud574\uc90d\ub2c8\ub2e4.  \\n\uc911\ucca9 \ucef4\ud3ec\ub10c\ud2b8\uac00 \uc788\ub2e4\uace0 \uc0dd\uac01\ud574\ubcf4\uaca0\uc2b5\ub2c8\ub2e4. \ubd80\ubaa8\uc758 \uc790\uc2dd\ud55c\ud14c props\ub85c \uc804\ub2ec\ud574\uc57c\ud558\ub294 \ub2e8\uacc4\uac00 \ub9ce\uc744 \uc218\ub85d \ucef4\ud3ec\ub10c\ud2b8 \uc0ac\uc774\uc5d0 \uc758\uc874\uc131 \ubc0f \uae4a\uc774\uac00 \uae38\uc5b4\uc9d1\ub2c8\ub2e4.  \\n\ud558\uc9c0\ub9cc useContext\ub97c \uc0dd\uc131\ud558\uc5ec \uc0ac\uc6a9\ud558\uba74 \ud544\uc694\ud55c \ucef4\ud3ec\ub10c\ud2b8\uc5d0\ub9cc \ub370\uc774\ud130\ub97c \uc804\ub2ec \ud560 \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc90d\ub2c8\ub2e4.  \\n\\n**\uc8fc\uc758**  \\n\ucee8\ud14d\uc2a4\ud2b8 \uc0ac\uc774\uc5d0 \uc0c1\ud0dc\uac12\uc774 \ubcc0\ud654\uac00 \ub418\uba74 \ud574\ub2f9 \uc0c1\ud0dc\ub97c \uc0ac\uc6a9\ud558\uace0\uc788\ub294 \ubaa8\ub4e0 \ucef4\ud3ec\ub10c\ud2b8\ub294 \ub2e4\uc2dc \ub80c\ub354\ub9c1 \ub429\ub2c8\ub2e4.  \\nuseMemo Hook\uc744 \uc0ac\uc6a9\ud574\uc11c \ub2e4\uc2dc \ub80c\ub354\ub9c1 \ub418\ub294 \uacbd\uc6b0\ub97c \ubc29\uc9c0\ud574\uc57c\ud569\ub2c8\ub2e4.  \\n\\n## useReducer \\n\ubcf5\uc7a1\ud55c \ucef4\ud3ec\ub10c\ud2b8\uc758 state\ub97c reducer\uac00 \uad00\ub9ac\ud560 \uc218 \uc788\ub3c4\ub85d \ud569\ub2c8\ub2e4.  \\nuseState\uc758 \ub300\uccb4\ud568\uc218\ub85c  **(state, action) => newState**\uc640 \ucd08\uae30\uac12\uc744 \ubcc0\uc218\ub85c \ubc1b\uace0 \ub3d9\uc791\uc5d0 \ub300\ud55c \uc0c1\ud0dc\uac12\uc744 \uc804\ub2ec\ud574 \uc90d\ub2c8\ub2e4.\\n\\n```js\\nconst initialState = {count: 0};\\n\\nfunction reducer(state, action) {\\n  switch (action.type) {\\n    case \'increment\':\\n      return {count: state.count + 1};\\n    case \'decrement\':\\n      return {count: state.count - 1};\\n    default:\\n      throw new Error();\\n  }\\n}\\n\\nfunction Counter() {\\n  const [state, dispatch] = useReducer(reducer, initialState);\\n  return (\\n    <>\\n      Count: {state.count}\\n      <button onClick={() => dispatch({type: \'decrement\'})}>-</button>\\n      <button onClick={() => dispatch({type: \'increment\'})}>+</button>\\n    </>\\n  );\\n}\\n```\\n\\n### useCallBack\\n\uba54\ubaa8\uc774\uc81c\uc774\uc158 (\ub3d9\uc77c\ud55c \uc5f0\uc0b0\uc758 \uac12\uc744 \uc800\uc7a5\ud558\uace0, \ubc18\ubcf5\uc791\uc5c5\uc744 \ubc29\uc9c0\ud558\uc5ec \ud504\ub85c\uadf8\ub7a8\uc744 \ube60\ub974\uac8c \uc2e4\ud589) callBack\ud568\uc218\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.  \\n\uc911\ubcf5\uc73c\ub85c \uad73\uc774 \uc5f0\uc0b0\uc774 \ubc18\ubcf5\uc801\uc73c\ub85c \uc791\uc5c5\ud560 \ud544\uc694\uac00 \uc788\uc744\uae4c\uc694?  \\nuseCallBack\uc740 state\uc5d0 \ub530\ub978, callBack \ud568\uc218\ub97c \ub9ac\ud134\ud569\ub2c8\ub2e4.\\n\uc0c1\ud0dc\uc5d0 \ub530\ub978 \uc758\uc874\uc131\uc744 \uac00\uc9c0\uace0 \ubcc0\ud654\uac00 \uc0dd\uae38 \ub54c, \ucf5c\ubc31\ud568\uc218\ub97c \ub9ac\ud134\ud569\ub2c8\ub2e4. \\n\\n```js\\nconst memoizedCallback = useCallback(\\n  () => {\\n    doSomething(a, b);\\n  },\\n  [a, b],\\n);\\n```\\n\\n\\n### useMemo\\nuseCallBack\uacfc \ube44\uc2b7\ud55c \uac1c\ub150\uc774\uc9c0\ub9cc \uc758\uc874\uc131\uc744 \uac00\uc9c4 state\uc758 \uac12\uc774 \ubcc0\ub3d9\uc774 \uc788\uc744 \ub54c,  \\n\uba54\ubaa8\uc774\uc81c\uc774\uc158 \ub41c \uac12\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.  \\n\uac12\uc774 \ubcc0\ud654\uac00 \uc5c6\uc744 \uacbd\uc6b0\uc5d0\ub294, \uc800\uc7a5\ub41c \uac12\uc744 \ub9ac\ud134\ud558\uc9c0\ub9cc, \uc0c1\ud0dc\uac00 \uac12\uc774 \ubcc0\uacbd\ub418\uc5b4 \uc654\uc744 \ub54c  \uc5f0\uc0b0\ub41c \uac12\uc744 \ub2e4\uc2dc \uc804\ub2ec\ud569\ub2c8\ub2e4.  \\n\ub2e8\uc21c\ud788 state\ub85c \uad00\ub9ac\ub418\ub294 \ucef4\ud3ec\ub10c\ud2b8\ub294 \uc758\uc874\uc131\uc744 \uac00\uc9c0\uae30 \ub54c\ubb38\uc5d0 \uc0c1\ud0dc \uac12\uc5d0 \ub530\ub978 \ubcc0\ud654\uac00 \uc5c6\uc744 \ub54c \ub80c\ub354\ub9c1\uc744 \uc81c\uc678\ud558\uae30 \uc704\ud574\uc11c \uc0ac\uc6a9\ud569\ub2c8\ub2e4.\\n\\n**\uc8fc\uc758**  \\nReact \uacf5\uc2dd \uc0ac\uc774\ud2b8\uc5d0\uc11c \ucd5c\uc801\ud654\ub97c \uc704\ud574\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc9c0\ub9cc, \uc758\ubbf8\uc0c1\uc73c\ub85c \ubcf4\uc7a5\uc774 \ub418\uace0\uc788\ub2e4\uace0\ub294 \ub9d0\ud558\uace0 \uc788\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\\n\\n```js\\nconst memoizedValue = useMemo(() => computeExpensiveValue(a, b), [a, b]);\\n```\\n\\n### useRef\\n\ud504\ub85c\ud37c\ud2f0\ub85c \uc804\ub2ec\ub41c \uc778\uc790\uc758 \ucd08\uae30\ud654\ub41c \uac1d\uccb4\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.  \\ntag\ub97c \ubc1b\uc544 \ucd08\uae30\ud654 \ub41c \uac1d\uccb4\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\n\\n```js \\nfunction TextInputWithFocusButton() {\\n  const inputEl = useRef(null);\\n  const onButtonClick = () => {\\n    // `current` points to the mounted text input element\\n    inputEl.current.focus();\\n  };\\n  return (\\n    <>\\n      <input ref={inputEl} type=\\"text\\" />\\n      <button onClick={onButtonClick}>Focus the input</button>\\n    </>\\n  );\\n}\\n```\\n\\n### useTransition\\n\\n```js\\nconst [isLoading, LoadingCallback] = useTransition()\\n```\\n\\n- \uc0c1\ud0dc\uac12\uc774 \ubcc0\ud654\ud558\ub294 \ub3d9\uc548\uc5d0, \uc0c1\ud0dc\uc640 \ud568\uc218\ub97c \uc124\uc815\ud569\ub2c8\ub2e4.\\n- \ub370\uc774\ud130 Fetching, api \uc911 \uc548\uc815\uc801\uc778 data \uc0c1\ud0dc\ub97c \ub9ac\ud134\ud569\ub2c8\ub2e4.\\n\\n---\\n\uc9c0\uae08 \uae4c\uc9c0 \ub300\ud45c\uc801\uc778 React Hook\uc744 \uc54c\uc544\ubd24\uc2b5\ub2c8\ub2e4.  \\n\uc544\uc9c1 \ucd94\uac00\uc801\uc73c\ub85c \ub9ce\uc740 hook\uc774 \uc788\uc9c0\ub9cc \uc2e4\uc81c \ub9ce\uc774 \uc0ac\uc6a9\ud558\ub294 hook\uc744 \uc815\ub9ac\ud588\ub294\ub370\uc694    \\n\ub9ce\uc740 \ub3c4\uc6c0\uc774 \ub418\uc5c8\uc73c\uba74 \uc88b\uaca0\uc2b5\ub2c8\ub2e4."},{"id":"Browser","metadata":{"permalink":"/devlog/blog/Browser","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-14-BroswerWork.md","source":"@site/blog/2022-12-14-BroswerWork.md","title":"Browser\ub294 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","description":"---","date":"2022-12-14T00:00:00.000Z","formattedDate":"2022\ub144 12\uc6d4 14\uc77c","tags":[{"label":"Browser","permalink":"/devlog/blog/tags/browser"},{"label":"basic","permalink":"/devlog/blog/tags/basic"}],"readingTime":4.115,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"slug":"Browser","title":"Browser\ub294 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","authors":"june","tags":["Browser","basic"]},"prevItem":{"title":"React\uc758 Hook\uc774\ub780?","permalink":"/devlog/blog/ReactHook"},"nextItem":{"title":"Internet \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","permalink":"/devlog/blog/internet"}},"content":"---\\n\\nWeb App\uc5d0\uc11c \ube0c\ub77c\uc6b0\uc800\ub294 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294 \uae30\ubcf8\uc801\uc778 \uc6d0\ub9ac\ub97c \uc815\ub9ac\ud558\uae30 \uc704\ud574\uc11c \uc791\uc131\ud569\ub2c8\ub2e4.\\n\\n# Broswer\ub294 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00?\\n\\n## Broswer\ub780? \\nBrowser\ub780 \uc6f9 \ud398\uc774\uc9c0, \uc774\ubbf8\uc9c0, \ube44\ub514\uc624\ub4f1 \ucee8\ud150\uce20\ub97c \uc218\uc2e0\ud558\uace0 \uc804\uc1a1\ud558\ub294 \uc18c\ud504\ud2b8\uc6e8\uc5b4\ub97c \ub9d0\ud55c\ub2e4.  \\n\uc6b0\ub9ac\uac00 \ud06c\ub86c, \uc0ac\ud30c\ub9ac, firefox \ub4f1.. \uc0ac\uc6a9\ud558\ub294 \uc18c\ud504\ud2b8\uc6e8\uc5b4\uac00 \ube0c\ub77c\uc6b0\uc800\ub2e4.\\n\\n## Browser\uc758 \uae30\ubcf8 \uad6c\uc870 \\n- \uc0ac\uc6a9\uc790 \uc778\ud130\ud398\uc774\uc2a4 : \uc694\uccad\ud558\ub294 \ud398\uc774\uc9c0 \ucc3d\uc744 \uc81c\uc678\ud55c \uc0ac\uc6a9\uc790\uac00 \uc0ac\uc6a9\ud558\ub294 \uc778\ud130\ud398\uc774\uc2a4\ub97c \ub9d0\ud55c\ub2e4.\\n- \ube0c\ub77c\uc6b0\uc800 \uc5d4\uc9c4 : \uc0ac\uc6a9\uc790 \uc778\ud130\ud398\uc774\uc2a4\uc640 \ub80c\ub354\ub9c1 \uc5d4\uc9c4 \uc0ac\uc774\uc5d0\uc11c \ub3d9\uc791\uc744 \uc81c\uc5b4\ud55c\ub2e4.\\n- \ub80c\ub354\ub9c1 \uc5d4\uc9c4 : \uc694\uccad\ud55c \ucee8\ud150\uce20\ub97c \ud45c\uc2dc\ud55c\ub2e4.\\n- \ud1b5\uc2e0 : HTTP \ud1b5\uc2e0 \ubc0f \ub124\ud2b8\uc6cc\ud06c \ud638\ucd9c\uc5d0 \uc0ac\uc6a9\ud55c\ub2e4.\\n- UI \ubc31\uc5d4\ub4dc : \uae30\ubcf8\uc801\uc778 \uc7a5\uce58\uc758 \uadf8\ub9bc\uc744 \uadf8\ub9ac\ub294\ub370 \uc0ac\uc6a9\ud55c\ub2e4.\\n- Javscript \ud574\uc11d\uae30 : \uc790\ubc14\uc2a4\ud06c\ub9bd\ud2b8\ub97c \ud574\uc11d\ud558\uace0 \uc2e4\ud589\ud55c\ub2e4.\\n- \uc790\ub8cc \uc800\uc7a5\uc18c : \ube0c\ub77c\uc6b0\uc800\uc5d0 \ub370\uc774\ud130\ub97c \uc800\uc7a5\ud558\ub294\ub370 \uc0ac\uc6a9\ud55c\ub2e4. \\n\\n**info** : \ud06c\ub86c \ube0c\ub77c\uc6b0\uc800\ub294 \uac01 \ud0ed\uc774 \ub80c\ub354\ub9c1 \uc778\uc2a4\ud134\uc2a4\ub97c \uc720\uc9c0\ud55c\ub2e4. \uc989, \uac01 \ud0ed\uc5d0\uc11c\ub294 \ub3c5\ub9bd\uc801\uc778 \ud504\ub85c\uc138\uc2a4 \uc9c4\ud589\ud55c\ub2e4.\\n\\n\\n\\n## Rendering engine \ub3d9\uc791 \uacfc\uc815\\n\\n\ub80c\ub354\ub9c1 \uc5d4\uc9c4\uc758 \uc2dc\uc791\uc740, \uc694\uccad\uc5d0 \uc758\ud55c \ubb38\uc11c \ub0b4\uc6a9\uc744 \uc5bb\ub294 \uac83 \ubd80\ud130 \uc2dc\uc791\ud558\uba70,  \\n\uae30\ubcf8\uc801\uc73c\ub85c 8kb \ub2e8\uc704\ub85c \uc804\uc1a1\ud55c\ub2e4.\\n\\n```txt\\n* \uae30\ubcf8\uc801\uc778 \ub3d9\uc791 \\nDOM \ud2b8\ub9ac \uad6c\ucd95\uc744\uc704\ud55c html \ud30c\uc2f1 -> \ub80c\ub354\ud2b8\ub9ac \uad6c\ucd95 -> \ub80c\ub354\ud2b8\ub9ac \ubc30\uce58 -> \ub80c\ub354\ud2b8\ub9ac \uadf8\ub9ac\uae30\\n```\\n\\n1. \ub80c\ub354\ub9c1 \uc5d4\uc9c4\uc740 HTML\ubb38\uc11c\ub97c \ud30c\uc2f1\ud55c\ub2e4. \\n2. \ucf58\ud150\uce20 \ud2b8\ub9ac \ub0b4\ubd80\uc5d0\uc11c DOM \ub178\ub4dc\ub85c \ubcc0\ud658\\n3. \uc678\ubd80 CSS \uc694\uc18c \ud30c\uc2f1 \ud6c4 \ub80c\ub354 \ud2b8\ub9ac \uc0dd\uc131 \\n4. UI \ubc31\uc5d4\ub4dc\uac00 \ub79c\ub354 \ud2b8\ub9ac\ub97c \uc21c\ud68c\ud558\uba74\uc11c \uad6c\ud604\\n\\n\uc704\uc640 \uac19\uc740 \uc21c\uc11c\ub85c html, css \ubb38\uc11c\ub97c DOM \ub178\ub4dc\ub97c \ud1b5\ud574\uc11c \uad6c\ud604\ud558\uac8c \ub41c\ub2e4.\\n\\n\\n## Parsing DOM \ud2b8\ub9ac \uad6c\ucd95\\nParsing\uc740 \uc18c\ud504\ud2b8\uc6e8\uc5b4\uac00 \uc778\uc2dd \ud560 \uc218 \uc788\ub294 \ud615\ud0dc\uc758 \uad6c\uc870\ub85c \ubcc0\ud658\ud558\ub294 \uc791\uc5c5\uc744 \ub9d0\ud55c\ub2e4.\\n\\n### Documnet Parsing\\n\ubb38\uc11c \ucf54\ub4dc html, css\ub4f1 \ub3d4\uc5d0\uc11c \uc774\ud574\ud560 \uc218 \uc788\ub294 \uad6c\uc131\uc758 \ucf54\ub4dc\ub97c \ub178\ub4dc\ub85c \ubcc0\ud658\ud574\uc11c \uad6c\uc131\ud558\uac8c \ub429\ub2c8\ub2e4. \\n\\n### HTML Parser\\n1. HTML \ubb38\uc11c\uc758 \ub9c8\ud06c\uc5c5\uc744 Parsing Tree\ub85c \uad6c\ud604\ud569\ub2c8\ub2e4.\\n2. HTML\uc758 \ubb38\ubc95\uc740 W3C\uc5d0\uc11c \uc815\uc758\ud55c \ub0b4\uc6a9\uc744 \ub530\ub77c \ubcc0\ud658\ud569\ub2c8\ub2e4. \\n\\n\uc774\ub807\uac8c HTML\uc744 \uc5f0\uc0b0\ud558\uc5ec, \ub178\ub4dc\ub85c \uad6c\ud604\ud558\uace0 \ubb38\uc11c\uc758 \ucd5c\uc0c1\uc704 \ub178\ub4dc\ub97c DOM\uc774 \ub429\ub2c8\ub2e4.\\n\uc989, DOM\uc740 \ubb38\uc11c\uc758 \ub300\ud55c \ub0b4\uc6a9\uc744 \uac00\uc9c0\uace0\uc774 \uc788\ub294 \uc5f0\uacb0\uc9c0\uc810 \uc785\ub2c8\ub2e4. \\n\\n### \ud1a0\ud070 \uc54c\uace0\ub9ac\uc998\\n\ud0dc\uadf8\uc758 \uc2dc\uc791\uacfc \ub05d\uc5d0 \ub300\ud55c html \ud1a0\ud070\uc744 \ubc1c\ud589\ud558\uc5ec, \ud1a0\ud070\uc774 \ud0dc\uadf8\uc758 \uc2dc\uc791\uacfc \ub05d\uc744 \\n\uc77d\uc5b4\ub4e4\uc5ec \ud604\uc7ac\uc758 \uc790\ub8cc \uc0c1\ud0dc\ub97c \ubc14\uafd4\uac00\uba74\uc11c \ud0dc\uadf8\ub97c \uc77d\uace0 \ud1a0\ud070\uc744 \uc77d\uc5b4 \ubc1c\ud589\ud55c\ub2e4.\\n\ud1a0\ud070\uc774 \uc0dd\uc131\ud558\uba74, \ud574\ub2f9\uc694\uc18c\ub97c \ubd99\uc5ec \ud45c\ud604\ud55c\ub2e4.\\n\\n\\n\uc704\uc640 \uac19\uc774 HTML, CSS\uac00 \ub80c\ub354\ub9c1 \uc911, Javascipt\ub97c \ub9cc\ub098\uac8c \ub418\uba74, Javasciprt \uc5d4\uc9c4\uc774 \uad8c\ud55c\uc744 \ubc1b\uc544 js \ud30c\uc77c\uc744 \ub2e4\uc6b4\ub85c \ubc0f \uc2e4\ud589\uc744 \ud558\uac8c \ub41c\ub2e4.\\n\\n\uc774\ub807\uac8c \ud654\uba74\uc758 \uad6c\uc870\uc640 \ud45c\ud604, \ub3d9\uc791\uc744 \ud45c\uc2dc\ud558\uba74\uc11c \ube0c\ub77c\uc6b0\uc800\uc758 \uc6f9\ud654\uba74\uc744 \ubcf4\uc5ec\uc8fc\uac8c \ub41c\ub2e4."},{"id":"internet","metadata":{"permalink":"/devlog/blog/internet","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-12-14-Internet.md","source":"@site/blog/2022-12-14-Internet.md","title":"Internet \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","description":"How to work internet","date":"2022-12-14T00:00:00.000Z","formattedDate":"2022\ub144 12\uc6d4 14\uc77c","tags":[{"label":"internet","permalink":"/devlog/blog/tags/internet"}],"readingTime":4.025,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"title":"Internet \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","description":"How to work internet","slug":"internet","authors":"june","tags":["internet"]},"prevItem":{"title":"Browser\ub294 \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","permalink":"/devlog/blog/Browser"},"nextItem":{"title":"Compiler vs Interpreter","permalink":"/devlog/blog/compiler-interpreter"}},"content":"---\\n\\nFE\ub97c \uacf5\ubd80\ud558\uba74\uc11c \uc624\ub79c\ub9cc\uc5d0 \uad6c\uae00\uc5d0 \uac80\uc0c9\ud558\uc5ec \uac1c\ubc1c \ub85c\ub4dc\ub9f5\uc744 \ubcf4\uc558\uc2b5\ub2c8\ub2e4.  \\n\uac1c\ubc1c \ub85c\ub4dc\ub9f5\uc744 \ubcf4\uba74\uc11c \uc5b8\uc5b4\ub9cc \uc2e0\uacbd\uc4f0\uace0 \uc788\uc5c8\ub294\ub370, \uac00\uc7a5 \uae30\ubcf8\uc801\uc778 \uc6d0\ub9ac\uc778 \uc778\ud130\ub137\uacfc \ube0c\ub77c\uc6b0\uc800\uc5d0 \ub300\ud574\uc11c \uc815\ud655\ud558\uac8c \ubaa8\ub974\uba74 \uc548\ub420 \uac83 \uac19\uc544 \uc815\ub9ac\ud558\ub294 \uae00\uc744 \uc791\uc131\ud569\ub2c8\ub2e4.\\n\\n\\n# Internet?\\n\\n\uc778\ud130\ub137\uc740 \ucef4\ud4e8\ud130\uc640 \ucef4\ud4e8\ud130\uc0ac\uc774\uc5d0 \ud1b5\uc2e0\uc774 \uac00\ub2a5\ud55c \uac70\ub300\ud55c \ub124\ud2b8\uc6cc\ud06c\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4.\\n\ucef4\ud4e8\ud130\uc640 \ucef4\ud4e8\ud130\uc758 \uc5f0\uacb0\uc740 \uc5b4\ub5bb\uac8c \uc774\ub8e8\uc5b4 \uc9c8\uae4c\uc694? \\n\\n## \uc5b4\ub5bb\uac8c \uc778\ud130\ub137\uc744 \ud1b5\ud574\uc11c \uc5f0\uacb0\uc744 \ud560\uae4c?\\n\\n\uc778\ud130\ub137\uc744 \ud1b5\ud574\uc11c \ucef4\ud4e8\ud130\uc640 \ucef4\ud4e8\ud130\ub97c \uc5f0\uacb0\ud558\ub294 \ubc29\uc2dd\uc740 \ub2e8\uc21c\ud558\uac8c \uc815\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.  \\n\\n- \uc774\ub354\ub137\\n- Wifi\\n- Bluetooth\\n\\n\ub2e8\uc21c\ud788 \ucef4\ud4e8\ud130\uc640 \ucef4\ud4e8\ud130\ub97c \uc5f0\uacb0\ud558\ub294 \ubc29\uc2dd\uc740 \uc704\uc640 \uac19\uc774 \uc815\ub9ac \ud560 \uc218 \uc788\ub294\ub370\uc694,  \\n\ud558\uc9c0\ub9cc \uc800\ud76c\uac00 \uc0ac\uc6a9\ud558\ub294 \uc778\ud130\ub137\uc740 \uc5c4\uccad\ub09c \uc218\uc758 \ucef4\ud4e8\ud130\ub97c \uc5f0\uacb0\ud574\uc57c\ud558\ub294\ub370 \uc804\uc790\uc758 \ubc29\uc2dd\uc740 \ub108\ubb34 \ub9ce\uc740 \uc120\uacfc, \ubd88\ud544\uc694\ud55c \uc18c\ube44\uac00 \uc0dd\uae41\ub2c8\ub2e4.\\n\\n\\n## \ub77c\uc6b0\ud130\\n\uc5ec\uae30\uc11c \ub77c\uc6b0\ud130\ub294 \ucef4\ud4e8\ud130\uc758 \ub2e8\uc21c\ud55c \uc5f0\uacb0 \ubc29\uc2dd\uc744 \uc18c\ud615\ucef4\ud4e8\ud130 \ub77c\uc6b0\ud130\uc5d0 \uc5f0\uacb0\ud558\uc5ec,  \\n\ub77c\uc6b0\ud130\ub294 \ucd9c\ubc1c\uc9c0\uc640 \ub3c4\ucc29\uc9c0\ub97c \uc815\ud655\ud558\uac8c \uc5f0\uacb0\ud574\uc8fc\ub294 \uc5ed\ud560\uc744 \ud569\ub2c8\ub2e4. \\n\\n\ub77c\uc6b0\ud130\ub3c4 \uc18c\ud615 \ucef4\ud4e8\ud130\uc774\uae30 \ub54c\ubb38\uc5d0 \ub77c\uc6b0\ud130 \uc0ac\uc774\uc5d0\uc11c\ub3c4 \uc5f0\uacb0\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4.  \\n\ud558\uc9c0\ub9cc \ub77c\uc6b0\ud130\ub3c4 \uc5f0\uacb0\uc5d0 \ud55c\uacc4\uac00 \uc788\uc2b5\ub2c8\ub2e4. \uc9c0\uc5ed\uacfc \uc9c0\uc5ed \uc0ac\uc774\uac00 \uba40\uc5b4\uc9c8 \uacbd\uc6b0   \\n\uc5f0\uacb0\ud558\uae30 \uc5b4\ub824\uc6cc \uc9c0\uc8e0, \uadf8\ub7fc \uc5b4\ub5a4 \ud574\uacb0 \ubc29\ubc95\uc774 \uc788\uc744\uae4c\uc694? \\n\\n\\n## \uc804\ud654\ucf00\uc774\ube14\uc744 \ud1b5\ud55c \uc778\ud130\ub137 \uc5f0\uacb0\\n\uc774\ubbf8 \uc804\uc138\uacc4\uc5d0 \uc804\ud654\ub294 \uc774\ubbf8 \ub2e4 \uc5f0\uacb0\uc774 \ub418\uc5b4\uc788\uace0, \ubc30\uc120\ub3c4 \ub9ce\uc740 \ubc94\uc704\ub85c \ud37c\uc838\ub098\uac00\uc788\uc2b5\ub2c8\ub2e4.  \\n\\n\uc5ec\uae30\uc11c \ubaa8\ub380\uc744 \ud1b5\ud574\uc11c, \uc804\ud654\uc2dc\uc124\uacfc \ub124\ud2b8\uc6cc\ud06c\uc640 \uc5f0\uacb0\ud569\ub2c8\ub2e4.  \\n\ubaa8\ub380\uc740 \uc6b0\ub9ac \ub124\ud2b8\uc6cc\ud06c\uc758 \uc815\ubcf4\ub97c \uc804\ud654 \uc2dc\uc124\uc5d0\uc11c \ucc98\ub9ac \ud560 \uc218\uc788\ub294 \uc815\ubcf4\ub85c \ubc14\uafb8\uba70, \uadf8 \ubc18\ub300\uc758 \uacbd\uc6b0\ub3c4 \ub9c8\ucc2c\uac00\uc9c0\uc785\ub2c8\ub2e4.\\n\\n\ub2e4\uc74c\uc73c\ub85c \ub124\ud2b8\uc6cc\ud06c\uc5d0\uc11c \ub124\ud2b8\uc6cc\ud06c \uc0ac\uc774\ub85c \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0b4\ub294 \uc791\uc5c5\uc5d0\uc11c ISP(Internet Service Provider)\ub97c \ud1b5\ud574\uc11c \ub2e4\ub978 \ub124\ud2b8\uc6cc\ud06c\uc5d0 \uc5f0\uacb0\ud558\uace0 \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0c5\ub2c8\ub2e4. \uc774\ub807\uac8c \uac70\ub300\ud55c \ub124\ud2b8\uc6cc\ud06c\uc640 \ub124\ud2b8\uc6cc\ud06c\uac00 \uc5f0\uacb0 \ub418\uc5b4\uc788\ub294 \uac83\uc744 \\n\uc778\ud130\ub137 \uc774\ub77c\uace0 \ud569\ub2c8\ub2e4.\\n\\n---\\n\\n### \ub124\ud2b8\uc6cc\ud06c\ub77c\ub294 \uac70\ub300\ud55c \uc778\ud504\ub77c\uc5d0\uc11c, \uc5b4\ub5bb\uac8c \ucef4\ud4e8\ud130\ub97c \ucc3e\uc744\uae4c?\\n\ucef4\ud4e8\ud130 \ub9c8\ub2e4 ip \uc8fc\uc18c\ub77c\ub294 \uace0\uc720\ud55c \ubc88\ud638\ub97c \uac00\uc9c0\uace0 \uc788\uc2b5\ub2c8\ub2e4.  \\n\uc774 \ubc88\ud638\ub97c \ucc3e\uc544\uac00\uc11c \uba54\uc2dc\uc9c0\ub97c \ubcf4\ub0b4\uace0 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.  \\n\uadf8\ub9ac\uace0 \uadf8 ip\uc8fc\uc18c\ub97c \uc27d\uac8c \ucc3e\uc744 \uc218 \uc788\uac8c \uba85\uba85\ud558\ub294 \uac83\uc744 \ub3c4\uc640\uc8fc\ub294 \uac83\uc774 _\ub3c4\uba54\uc778_ \uc785\ub2c8\ub2e4. \\n\\n\\n\\n\uc774\ub807\uac8c \uae00\uc744 \uc815\ub9ac\ud558\uba74\uc11c, \uac1c\ub150\uc744 \uc7a1\uace0 \uac08 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.  \\n\uae4a\uac8c \ud30c\uace0\ub4e4\uba74 \ub354 \ub9ce\uc740 \uc9c0\uc2dd\uc774 \uc788\uaca0\uc9c0\ub9cc, \uc804\ubc18\uc801\uc778 \uc774\ud574\ub97c \ub3d5\ub294 \uae00\uc744 \uc791\uc131\ud558\ub824\uace0\ud588\uc2b5\ub2c8\ub2e4. \\n\\n\uac10\uc0ac\ud569\ub2c8\ub2e4.\\n\\n\\n\\n- \ucc38\uace0 : \\n[MDN Web docs](https://developer.mozilla.org/ko/docs/Learn/Common_questions/How_does_the_Internet_work)"},{"id":"compiler-interpreter","metadata":{"permalink":"/devlog/blog/compiler-interpreter","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-11-03-complier-interpreter-v1.md","source":"@site/blog/2022-11-03-complier-interpreter-v1.md","title":"Compiler vs Interpreter","description":"Complier and Interpreter gap","date":"2022-11-03T00:00:00.000Z","formattedDate":"2022\ub144 11\uc6d4 3\uc77c","tags":[{"label":"compiler","permalink":"/devlog/blog/tags/compiler"},{"label":"interpreter","permalink":"/devlog/blog/tags/interpreter"}],"readingTime":5.86,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"title":"Compiler vs Interpreter","description":"Complier and Interpreter gap","slug":"compiler-interpreter","authors":"june","tags":["compiler","interpreter"]},"prevItem":{"title":"Internet \uc5b4\ub5bb\uac8c \ub3d9\uc791\ud558\ub294\uac00","permalink":"/devlog/blog/internet"},"nextItem":{"title":"Flex\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uc790","permalink":"/devlog/blog/CSS,Flex"}},"content":"\ud504\ub85c\uadf8\ub798\ubc0d\uc740 \ud544\uc694\ud55c \uc694\uad6c\uc0ac\ud56d \ubc0f \uae30\ub2a5 \uad6c\ud604\uc744 \ud558\uae30 \uc704\ud574\uc11c \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\ub97c \ud1b5\ud574 \ucef4\ud4e8\ud130\uac00 \uc54c\uc544 \ub4e4\uc744 \uc218 \uc788\ub3c4\ub85d  \\n\uc5b8\uc5b4\ub97c \ud574\uc11d\ud558\uc5ec \ucef4\ud4e8\ud130\ud55c\ud14c \uc804\ub2ec\ud558\ub294 \uacfc\uc815\uc774\ub77c\uace0 \ub9d0 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.  \\n\\n\uc5ec\uae30\uc11c \uc778\uac04\uc758 \uc5b8\uc5b4\ub97c \ucef4\ud4e8\ud130\uac00 \uc774\ud574\ud560 \uc218 \uc788\ub294 \uae30\uacc4\uc5b4\ub85c \ubcc0\ud658\uc744 \ud574\uc8fc\ub294 \uc5ed\ud560\uc774 \ucef4\ud30c\uc77c\ub7ec\uc785\ub2c8\ub2e4.  \\n\ud558\uc9c0\ub9cc, \uae30\uacc4\uc5b4\ub97c \ud574\uc11d\ud558\uace0 \uc2e4\ud589\ud558\ub294 \ubaa9\uc801\uc740 \uac19\uc9c0\ub9cc \ucef4\ud30c\uc77c\ub7ec\uc640 \ub2e4\ub978 \uc778\ud130\ud504\ub9ac\ud130\uc758 \ucc28\uc774\ub97c \uae30\ub85d\ud558\ub824\uace0\ud569\ub2c8\ub2e4.\\n\\n\\n## \ucef4\ud30c\uc77c\ub7ec \\n\\n- \uc815\uc758 : \ud2b9\uc815 \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\ub85c \uc4f0\uc5ec\uc788\ub294 \ubb38\uc11c\ub97c \ub2e4\ub978 \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\ub85c \uc62e\uae30\ub294 \uc5b8\uc5b4 \ubc88\uc5ed \ud504\ub85c\uadf8\ub7a8\\n- \uc0ac\uc6a9 \ubaa9\uc801: \uace0\uae09 \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\ub97c \uc800\uae09 \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\ub85c \ubcc0\ud658\ud558\ub294 \uc5ed\ud560\uc744 \ud55c\ub2e4\\n  - \uc800\uae09 \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4 : \uc5b4\uc148\ube14\ub9ac\uc5b4 \uc5b8\uc5b4, \uae30\uacc4\uc5b4, object code\\n\\n## \ucef4\ud30c\uc77c\ub7ec \uc6d0\ub9ac\\n\\n_\ucef4\ud30c\uc77c\ub7ec\ub294 \uaf2d \uc9c0\ucf1c\uc57c\ud560 2\uac00\uc9c0 \uc870\uac74\uc774 \uc788\ub2e4!!_  \\n\\n1. \ucef4\ud30c\uc77c\ub7ec\ub294 \uc62e\uae30\ub294 \uacfc\uc815\uc5d0\uc11c \ud504\ub85c\uadf8\ub7a8 \ub73b\uc744 \ubcf4\uc874\ud574\uc57c \ud55c\ub2e4.\\n  ```txt\\n  \ucef4\ud30c\uc77c\ub7ec\ub294 \uc0ac\uc6a9\ud558\ub294 \uc0ac\uc6a9\uc790\uc758 \uc758\ub3c4\uc640 \ub0b4\uc6a9\uc744 \ubcf4\uc874\ud574\uc57c\ud558\ub294 \uc870\uac74\uc774 \uc788\ub2e4. \ub2f9\uc5f0\ud55c \uc870\uac74 \uac19\uc544 \uc0ac\ub78c\uc774 \uc5b4\ub5a4 \uc758\ub3c4\ub97c \uac00\uc9c0\uace0  \\n  \uc791\uc131\ud55c \ub0b4\uc6a9\uc778\uc9c0 \ubcf4\uc874\ud558\uc9c0 \uc54a\uc73c\uba74, \ucef4\ud30c\uc77c\ub7ec\ub97c \uc0ac\uc6a9\ud560 \uc774\uc720\uac00 \uc5c6\uc5b4\uc9c0\uace0, \ud504\ub85c\uadf8\ub7a8\uc744 \uc791\uc131\ud560 \uc218 \ub3c4 \uc5c6\uc744 \uac83 \uac19\ub2e4. \\n  ```\\n\\n2. \uc131\ub2a5\uc801\uc778 \uba74\uc5d0\uc11c \ucef4\ud30c\uc77c\ub7ec\ub294 \ud504\ub85c\uadf8\ub7a8\uc744 \uac1c\uc120\ud574\uc57c\ud55c\ub2e4. \\n  ```txt\\n  \ucef4\ud30c\uc77c\ub7ec\ub294 \uae30\uacc4\uc5b4\ub85c \ubcc0\uacbd\ud558\ub294 \uac83\uc744 \ud3ec\ud568\ud558\uc5ec \ud504\ub85c\uadf8\ub7a8\uc758 \uc131\ub2a5\uc744 \uac1c\uc120\uc2dc\ucf1c\uc57c\ud55c\ub2e4. \\n  \uae30\uacc4\uc5b4\ub97c \ubcc0\uacbd\ud558\ub294 \uac83\uc744 \ud3ec\ud568\ud558\uc5ec, \uc131\ub2a5\uc801\uc778 \uac1c\uc120\ub418\uc5b4\uc57c\ud558\ub294 \uc7a5\uc810\uc774 \uc788\ub2e4.\\n  ```\\n\\n\\n## \ucef4\ud30c\uc77c\ub7ec\uc758 \uc2e4\ud589\ub2e8\uacc4 \\n\\n1. \uad6c\ubb38\ubd84\uc11d : \uc18c\uc2a4\ucf54\ub4dc\uc758 \ud30c\uc77c\uc744 \uc77d\uc5b4 \ubb38\ubc95, \uc5f0\uc0b0\uc790\ub97c \uc790\ub978 \ud6c4, \ucd94\uc0c1 \uad6c\ubb38 \ud2b8\ub9ac\ub97c \uc0dd\uc131\ud55c\ub2e4.  \\n\uc774 \uacfc\uc815\uc5d0\uc11c \ubb38\ubc95\uc5d0 \ub9de\uc9c0 \uc54a\ub294 \uc18c\uc2a4 \ucf54\ub4dc\ub97c \uc0ac\uc6a9\uc790\uc5d0\uac8c \uc54c\ub824\uc900\ub2e4.\\n\\n2. \ucd5c\uc801\ud654 : \ud45c\ud604\uc2dd\uc744 \ubbf8\ub9ac \uacc4\uc0b0\ud558\uac70\ub098, \ub8e8\ud504 \ud480\uae30\ub4f1  \ucd5c\uc801\ud654\ub97c \uc774 \ub2e8\uacc4\uc5d0\uc11c \ud55c\ub2e4.\\n\\n3. \ucf54\ub4dc \uc0dd\uc131 : \ubcc0\ud658\ud558\ub294 \ubaa9\uc801 \ucf54\ub4dc\ub97c \uc0dd\uc131\ud55c\ub2e4.\\n\\n4. \ub9c1\ud0b9 : \uc5ec\ub7ec \ub77c\uc774\ube0c\ub7ec\ub9ac  \ubaa9\uc801 \ucf54\ub4dc\ub97c \ubb36\uc5b4 \ud558\ub098\uc758 \uc2e4\ud589 \ud30c\uc77c\uc744 \uc0dd\uc131\ud558\uac8c \ub41c\ub2e4.\\n\\n\\n## \uc778\ud130\ud504\ub9ac\ud130\\n\\n- \uc815\uc758 : \ucef4\ud30c\uc77c\ub7ec\uc640 \ub2e4\ub974\uac8c \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4 \uc18c\uc2a4\ucf54\ub4dc\ub97c \ubc14\ub85c \uc0d0\ud589\ud558\ub294 \ud658\uacbd\uc744 \ub9d0\ud55c\ub2e4.\\n- \uc2e4\ud589\ub2e8\uacc4 \\n  - \uc18c\uc2a4 \ud06c\ub4dc\ub97c \uc9c1\uc811 \uc2e4\ud589\ud55c\ub2e4.\\n  - \uc18c\uc2a4 \ucf54\ub4dc\ub97c \ud6a8\uc728\uc801\uc778 \ub2e4\ub978 \uc911\uac04 \ucf54\ub4dc\ub85c \ubcc0\ud658\ud558\uace0 \ubcc0\ud658 \ub0b4\uc6a9\uc744 \uc2e4\ud589\ud55c\ub2e4. \\n  - \uc778\ud130\ud504\ub9ac\ud130 \uc2dc\uc2a4\ud15c\uc758 \uc77c\ubd80\uc778 \ucef4\ud30c\uc77c\ub7ec\uac00 \ub9cc\ub4e0, \ubbf8\ub9ac \uc800\uc7a5\ub41c \ucf54\ub4dc\ub97c \uc2e4\ud589\uc744 \ud638\ucd9c \ud55c\ub2e4. \\n\\n\uc778\ud130\ud504\ub9ac\ud130\ub294 \ucef4\ud30c\uc77c\ub7ec\uac00 \ud558\ub294 \uae30\uacc4\uc5b4\ub97c \ubcc0\ud658\ud558\ub294 \ub2e8\uacc4\ub97c \uac00\uc9c0\uace0 \ubcc0\ud658\ud558\ub294 \uac83\uc774 \uc544\ub2cc \ud55c \uc904\uc529 \uc77d\uc73c\uba74\uc11c, \ubc14\ub85c \uc2e4\ud589\ud55c\ub2e4.  \\n\uac00\uc7a5 \ud070 \ucc28\uc774\uc810\uc778 \ubcc0\ud658\uacfc \uc2e4\ud589\uc5d0 \ucc28\uc774\uac00 \uc788\uc744 \uac83\uc774\uace0 \uc774 \ucc28\uc774\ub85c \uc0dd\uae30\ub294 \uc7a5\ub2e8\uc810\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uc790.\\n\\n---\\n\\n### \uc7a5\ub2e8\uc810 \ube44\uad50\\n\\n**\ucef4\ud30c\uc77c\ub7ec** \\n- \uc7a5\uc810 \\n  - \ucef4\ud30c\uc77c\uc744 \ud55c\ubc88\uc5d0 \ud558\uae30 \ub54c\ubb38\uc5d0 \ubcc0\ud658\uc2dc\uac04\uc5d0\ub294 \uc624\ub798 \uac78\ub9ac\uc9c0\ub9cc, \uc2e4\ud589\ub2e8\uacc4\uc5d0\uc11c\ub294 \uc2e4\ud589\uc18d\ub3c4\uac00 \ube60\ub974\ub2e4. \\n- \ub2e8\uc810\\n  - \uc6d0\uc2dc\ucf54\ub4dc\ub85c \ubcc0\uacbd \uc2dc, \ucf54\ub4dc\uc758 \uc591\uc774 \ub9ce\uc744 \uacbd\uc6b0 \ucef4\ud30c\uc77c \ub2e8\uacc4\uc5d0\uc11c \uc2dc\uac04\uc774 \uc624\ub798 \uac78\ub9b0\ub2e4.\\n  - \ucef4\ud30c\uc77c\uc744 \ud574\uc57c\ub9cc \uc2e4\ud589\uc774 \uac00\ub2a5\ud558\ub2e4.\\n  - \ucef4\ud30c\uc77c \uc774\ud6c4\uc5d0 \uc218\uc131\uc0ac\ud56d\uc744 \uc54c\ub824\uc900\ub2e4.\\n\\n**\uc778\ud130\ud504\ub9ac\ud130** \\n- \uc7a5\uc810\\n  - \ucef4\ud30c\uc77c \ub2e8\uacc4\ub97c \uac70\uce60 \ud544\uc694\uac00 \uc5c6\ub2e4\ub294 \uc7a5\uc810\uc774\ub2e4. \uc989 \uae30\uacc4\uc5b4\ub85c \ubcc0\ud658\ud560 \ud30c\uc77c\uc744 \uc0dd\uc131 \ub2e8\uacc4\uac00 \uc5c6\uc5b4 \uc2e4\ud589 \ub2e8\uacc4 \uc774\uc804\uc758 \uc2dc\uac04\uc774 \ub2e8\ucd95\ub41c\ub2e4.\\n  - \uc2e4\ud589 \ud558\uba74\uc11c \uc5d0\ub7ec\ub97c \ubc14\ub85c \uc54c\ub824\uc8fc\ub294 \uc7a5\uc810\uc774 \uc788\ub2e4.\\n- \ub2e8\uc810 \\n  - \ud55c \uc904\uc529 \uc2e4\ud589\ud558\uae30 \ub54c\ubb38\uc5d0, \uc2e4\ud589\ub2e8\uacc4\uc5d0\uc11c \uc18d\ub3c4\uac00 \ub2a6\uc5b4\uc9c4\ub2e4.\\n\\n---\\n\\n\uc774\ub807\uac8c 2\uac00\uc9c0 \ucef4\ud30c\uc77c\ub7ec\uc640 \uc778\ud130\ud504\ub9ac\ud130\ub97c \ucc3e\uc544\ubcf4\uace0 \uc54c\uc544 \ubd24\uc2b5\ub2c8\ub2e4.  \\n\ud504\ub85c\uadf8\ub798\ubc0d \uacf5\ubd80\ub97c \ud560 \ub54c, \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4\uc758 \ub3d9\uc791\uacfc \uc6d0\ub9ac\uc758 \ucef4\ud30c\uc77c\ub7ec\uc640 \uc778\ud130\ud504\ub9ac\ud130\ub97c \ube7c\ub193\uc744 \uc218 \uac00 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4.\\n\uae4a\uac8c \ub4e4\uc5b4\uac00\uba74, \uc870\uae08 \ub354 \uacf5\ubd80\ud560 \ub0b4\uc6a9\uc774 \ub9ce\uc744 \uac83 \uac19\uc740\ub370, \uae30\ubcf8 CS\uc9c0\uc2dd\uc73c\ub85c \ubc30\uc6b0\uba74\uc11c \uc880 \ub354 \uacf5\ubd80\ud574\uc57c\ud560 \uac83 \uac19\uc2b5\ub2c8\ub2e4."},{"id":"CSS,Flex","metadata":{"permalink":"/devlog/blog/CSS,Flex","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-09-27-Flex.md","source":"@site/blog/2022-09-27-Flex.md","title":"Flex\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uc790","description":"---","date":"2022-09-27T00:00:00.000Z","formattedDate":"2022\ub144 9\uc6d4 27\uc77c","tags":[{"label":"CSS","permalink":"/devlog/blog/tags/css"},{"label":"FLEX","permalink":"/devlog/blog/tags/flex"}],"readingTime":3.355,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"slug":"CSS,Flex","title":"Flex\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uc790","authors":"june","tags":["CSS","FLEX"]},"prevItem":{"title":"Compiler vs Interpreter","permalink":"/devlog/blog/compiler-interpreter"},"nextItem":{"title":"React-Router-Dom \ud65c\uc6a9 \ubc0f Link \ud0dc\uadf8 \uc2a4\ud0c0\uc77c\ud558\uae30","permalink":"/devlog/blog/React-Router-Dom"}},"content":"--- \\n\\n\\n# CSS Flex?\\n\\n- Flex \uc544\uc774\ud15c\uc774 \uc790\uc2e0\uc758 \ucee8\ud14c\uc774\ub108\uc5d0 \ucc28\uc9c0\ud558\ub294 \uacf5\uac04\uc5d0 \ub9de\ucd94\uae30 \uc704\ud55c \uc18d\uc131\\n- Flex\ub294 \ub2e8\ucd95 \uc18d\uc131\uc73c\ub85c \uc544\ub798\uc640 \uac19\uc740 \uc18d\uc131\uc744 \uac16\ub294\ub2e4.\\n  - flex-grow\\n  - flex-shrink\\n  - flex-basis\\n\\n## Flex\uc758 \ud2b9\uc131\\n- \ub300\ubd80\ubd84\uc758 \uacbd\uc6b0, flex\uc758 \uac12\uc740 auto, initial, none, \ub2e8\uc704 \uc5c6\ub294 \uc591\uc218\uc758 \uac12\uc744 \uc0ac\uc6a9 \\n- flex\uc758 \uc544\uc774\ud15c\uc740 \ucee8\ud150\uce20\uc758 \ucd5c\uc18c\ud55c\uc758 \ub113\uc774 \ubbf8\ub9cc\uc73c\ub85c \uc904\uc5b4\ub4e4\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\\n  -  \ubcc0\uacbd\uc744 \uc6d0\ud560 \ub54c\ub294, min-height, min-width\ub97c \uc0ac\uc6a9\ud569\ub2c8\ub2e4.\\n- flex\uc758 \ud55c \uac1c\uc758 \uac12\uc73c\ub85c \uc138 \uac00\uc9c0 \uac12\uc744 \uc9c0\uc815\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \\n  - number type : flex-grow\\n  - length, percentage : flex-basis\\n  - none, auto, initial\\n- flex \uac12\uc774 2\uac1c\uc77c \ub54c\\n  - \uccab \ubc88\uc9f8 \uac12\uc740 number type : flex-grow\\n  - \ub450 \ubc88\uc9f8 \uac12\uc740\\n    - number : flex-shrink\\n    - length, percentage(auto) : flex-basis\\n\\n## Flex Property\\n\\n- initial : \uc544\uc774\ud15c\uc758 \ud06c\uae30\uac00 width, height \uc18d\uc131\uc5d0 \ub530\ub77c \uc815\ud574\uc9d1\ub2c8\ub2e4. \ud50c\ub809\uc2a4 \ucee8\ud14c\uc774\ub108\uc758 \ud06c\uae30\ub97c \ub118\uc9c0 \uc54a\uae30 \uc704\ud574\uc11c \uc904\uc5b4 \ub4e4 \uc218\ub294 \uc788\uc9c0\ub9cc \ub0a8\uc740 \uacf5\uac04\uc744 \ucc44\uc6b0\ub824\uace0 \ud558\uc9c0\ub294 \uc54a\uc2b5\ub2c8\ub2e4.\\n  - \uac19\uc740 \ud45c\ud604 = flex: 0 1 auto\\n- auto : initial \uc18d\uc131\uacfc \uac19\uc9c0\ub9cc \ub2e4\ub978\uc810\uc740, \ub0a8\uc740 \uacf5\uac04\uc744 \ucc44\uc6b8\ub824\uace0 \ud560 \uc218 \ub3c4 \uc788\uc2b5\ub2c8\ub2e4.\\n  - \uac19\uc740 \ud45c\ud604 = flex: 1 1 auto\\n- none : width, height\ub294 \uc704\uc640 \uac19\uc774 \uc18d\uc131\uc5d0 \ub530\ub77c \uc815\ud574\uc9d1\ub2c8\ub2e4. \ucee8\ud14c\uc774\ub108\uc640 \ud06c\uae30\uc640 \uc0c1\uad00\uc5c6\uc774 \ubcc0\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\\n  - \uac19\uc740 \ud45c\ud604 = flex : 0 0 auto\\n- flex-grow : \\n  - flex-item\uc758 \uc694\uc18c\uac00 \ucee8\ud14c\uc774\ub108\uc5d0\uc11c \ucc28\uc9c0\ud558\ub294 \uacf5\uac04\uc758 \uc815\ub3c4\ub97c \uc9c0\uc815\ud569\ub2c8\ub2e4.\\n  - flex-item\ub4e4\uc774 \uac19\uc740 \uac12\uc744 \uac00\uc9c4\ub2e4\uba74, \uac19\uc740 \ud06c\uae30\ub97c \uc9c0\uc815 \ubc1b\uc2b5\ub2c8\ub2e4.\\n- flex-shrink :\\n  - \ucee8\ud14c\uc774\ub108\ubcf4\ub2e4 item\uc758 \uc694\uc18c\uac00 \ud074 \ub54c \uc0ac\uc6a9\ud569\ub2c8\ub2e4. \\n  - \uc124\uc815\uc758 \ud06c\uae30\ub9cc\ud07c item\uc758 \ud06c\uae30\uac00 \ucee4\uc9c8 \ub54c \ucd95\uc18c \ud560 \ub54c \uc0ac\uc6a9\ud569\ub2c8\ub2e4.\\n- flex-basis :\\n  - item\uc758 \ucd08\uae30 \ud06c\uae30\ub97c \uc9c0\uc815\ud569\ub2c8\ub2e4.\\n  - box-sizing\uc744 \uc9c0\uc815\ud558\uc9c0 \uc54a\uc73c\uba74 \ucee8\ud150\uce20\uc758 \ubc15\uc2a4\uc758 \ud06c\uae30\ub97c \uc9c0\uc815\ud569\ub2c8\ub2e4.\\n\\n### Flex\ub97c \uc815\ub9ac\ud55c \uc774\uc720\ub294\\n- \ub300\ubd80\ubd84\uc758 \uc815\ub82c\uc740 display: flex \uc18d\uc131\uc744 \uc0ac\uc6a9\ud574\uc11c\uc600\ub2e4\\n- margin, padding\uc744 \uc8fc\ub294 \uc21c\uac04 flex\uc758 \uc911\uc559 \uc815\ub82c\uc774 \ubc00\ub9ac\ub294 \ud604\uc0c1\uc774 \uc788\uc5c8\ub2e4 \\n- item\uc758 \uc0ac\uc774\uc5d0 \uc601\uc5ed\uc744 \uce68\ubc88\ud558\ub294  \ubd80\ubd84\uc744 \ud6a8\uc728\uc801\uc73c\ub85c \uc218\uc815\ud558\uae30 \uc704\ud574\uc11c flex\ub97c \uacf5\ubd80\ud558\uc600\ub2e4.\\n- header\uc758 \ub85c\uace0, \ud0c0\uc774\ud2c0, \uba54\ub274 \ubd80\ubd84\uc744 \uc0c1\ub300\uc801\uc778 \ud06c\uae30\ub97c \uc9c0\uc815\ud574\uc5ec \uc11c\ub85c\uc758 \uc601\uc5ed\uc744 \uce68\ubc94\ud558\uc9c0 \ubabb\ud558\ub3c4\ub85d \ud558\uc600\ub2e4.\\n  \\n\ud639\uc5ec\ub098, flex\uc758 \ub0a8\ubc1c\ub85c, \ud654\uba74\uc744 \uad6c\ud604\ud558\ub294 \ubd80\ubd84\uc774 \uc788\uc5b4\uc11c, \uc0c8\ub85c\uc6b4 \ubc29\ud5a5\uc73c\ub85c \ud654\uba74 \uad6c\uc131\ud558\ub294 \uc18d\uc131\uc744 \uc815\ub9ac\ud574\uc11c \uc62c\ub9bd\ub2c8\ub2e4.\\n\\n\\n#### \ucc38\uace0\\n[\ucc38\uace0\uc790\ub8cc : MDN \uacf5\uc2dd\uc0ac\uc774\ud2b8](https://developer.mozilla.org/ko/docs/Web/CSS/flex-basis)"},{"id":"React-Router-Dom","metadata":{"permalink":"/devlog/blog/React-Router-Dom","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-05-31-ReactRouterDom.md","source":"@site/blog/2022-05-31-ReactRouterDom.md","title":"React-Router-Dom \ud65c\uc6a9 \ubc0f Link \ud0dc\uadf8 \uc2a4\ud0c0\uc77c\ud558\uae30","description":"---","date":"2022-05-31T00:00:00.000Z","formattedDate":"2022\ub144 5\uc6d4 31\uc77c","tags":[{"label":"React","permalink":"/devlog/blog/tags/react"},{"label":"React-Router-Dom","permalink":"/devlog/blog/tags/react-router-dom"}],"readingTime":3.765,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"slug":"React-Router-Dom","title":"React-Router-Dom \ud65c\uc6a9 \ubc0f Link \ud0dc\uadf8 \uc2a4\ud0c0\uc77c\ud558\uae30","authors":"june","tags":["React","React-Router-Dom"]},"prevItem":{"title":"Flex\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uc790","permalink":"/devlog/blog/CSS,Flex"},"nextItem":{"title":"Upstream, DownStream","permalink":"/devlog/blog/Upstream, DownStream"}},"content":"---\\n\\n# React-Router-Dom\uc744 \uc774\uc6a9\ud574\ubcf4\uc790\\n\\n\uc624\ub298\uc740 React\ub97c \ubc30\uc6b0\uace0 \uacf5\ubd80\ud558\uba74\uc11c, \uacc4\uc18d CRA\ub85c \ud504\ub85c\uc81d\ud2b8\ub97c \ub9cc\ub4e4\uace0, \ucef4\ud3ec\ub10c\ud2b8\ub97c \uacc4\uc18d \ub9cc\ub4dc\ub294 \uac83\uc5d0 \uc9c0\uce58\uace0 \uc788\uc5c8\ub2e4.  \\n\uadfc\ub370 react-router-dom, react-router lib\uc744 \uc54c\uace0 \ub098\uc11c \uc774\uac83\uc73c\ub85c \uc608\uc81c \ud30c\uc77c\ub4e4\uc744 \uad00\ub9ac\ud558\uace0 \uc2f6\uc5b4\uc84c\ub2e4.  \\n\\n\uc77c\ub2e8, \uc5b4\ub5a4 lib\uc778\uc9c0, \uc5b4\ub5bb\uac8c \uc0ac\uc6a9\ud558\ub294\uc9c0 \uae30\ubcf8\ubd80\ubd84 \ub9cc \uc124\uba85\ud558\uace0, \uac04\ub2e8\ud55c \uc608\uc81c\ub85c \uc815\ubcf4\ub97c \uc804\ub2ec\ud558\ub824\uace0 \ud55c\ub2e4.\\n\\n\\n## React-Router\\n\\nreact\uc5d0\uc11c SPA(Single Page Application)\ub97c \uc27d\uac8c \ub3c4\uc785\ud560 \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc8fc\ub294 lib\ub85c\uc368, \ud398\uc774\uc9c0 \uc774\ub3d9  \\n\uad00\ub828\ud558\uc5ec \ud3b8\ud558\uac8c \uc9c0\uc6d0\ud574\uc8fc\ub294 lib\uc774\ub2e4.\\n\\n\uc77c\ub2e8 ... \uc124\uce58\ubd80\ud130 \ud574\ubcf4\uc790\\n\\n\\n- \uc124\uce58 \\n\\n```bash\\n$ npm i react-router-dom\\n```\\n\\n\uc124\uce58\ub97c \ud588\uc73c\uba74 \uc5b4\ub5bb\uac8c \uc0ac\uc6a9\ud558\ub294\uc9c0 \uc608\uc81c\ub97c \ubcf4\uc790...\\n\\n```js\\nimport { BrowserRouter, Route, Routes, Link } from \\"react-router-dom\\";\\n\\nconst Hello = () => (\\n  <Link to=\'/\'>to home</Link>\\n);\\nconst Main = () => (\\n  <Link to=\'/hello\'>to hello</Link>\\n);\\nconst App = () => { \\n  return (\\n  <BrowserRouter>\\n    <Routes>\\n      <Route path=\\"/\\" element={<Main />} />\\n      <Route path=\\"/hello\\" element={<Hello />} /> \\n    </Routes>\\n  </BrowserRouter>\\n  );\\n}\\n```\\n\\n\\n- import : react-route-dom\uc5d0\uc11c  \ud604\uc7ac \ud544\uc694\ud55c  BrowserRouter, Route, Routes, Link \ub140\uc11d\ub4e4\uc744 \uac00\uc838\uc624\uc790 \\n- BrowserRouter : \ud574\ub2f9 lib\uc744 \uc0ac\uc6a9\ud560 app\uc5d0\uc11c \ud55c \ud55c\ubc88\ub9cc \uc0ac\uc6a9\ud55c\ub2e4. \ud398\uc774\uc9c0 \uc774\ub3d9\uc744 \uc704\ud55c router\ub97c \uc0ac\uc6a9 \uc704\uce58\ub97c \uc9c0\uc815\ud574\uc900\ub2e4.\\n-  Routes : \ud398\uc774\uc9c0 \uc774\ub3d9\uc744 \uc120\uc5b8\ud558\ub294 Route\ub97c  \ub3d9\uc791\ud558\ub3c4\ub85d \ud55c\ub2e4.\\n-  Route :  props\uc73c\ub85c  path(url) \uc0ac\uc6a9 \uacbd\ub85c, element(\ubcf4\uc5ec\uc904 \ucef4\ud3ec\ub10c\ud2b8)\ub97c \uc815\uc758\ud55c\ub2e4.(url\uc77c\uce58\ud558\uba74 \uac00\uc7a5 \uba3c\uc800 \uc77c\uce58\ud55c route\ub97c \ubcf4\uc5ec\uc900\ub2e4.)\\n-  Link/ : props to\uc5d0 \uc801\ud78c url\ub85c  request\uac00 \uc544\ub2cc url \ubcc0\uacbd \ud6c4 \ucef4\ud3ec\ub10c\ud2b8\ub97c \ubcf4\uc5ec\uc900\ub2e4.\\n\\n\uc194\uc9c1\ud788 React\ub97c \uc0ac\uc6a9\ud558\uba74\uc11c, lib \uc0ac\uc6a9\ud558\ub294 \ubc29\ubc95\uc744 \uc775\ud788\ub294\uac8c \ub354\uc6b1 \uc5b4\ub824\uc6b4 \uac83 \uac19\ub2e4.... \uc5ec\ud2bc \ub2e4\uc2dc \uc8fc\uc81c\ub85c \ub118\uc5b4\uc624\uba74\\n\\n\uc704\uc640 \uac19\uc740 \ubc29\uc2dd\uc73c\ub85c React \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc5f0\uc2b5\ud558\uace0 \ud14c\uc2a4\ud2b8\ud55c \ub0b4\uc6a9\uc744 \ud55c\ubc88\uc5d0 \ubcf4\uc5ec\uc8fc\uae30 \uc704\ud574\uc11c \\n\\n\\n\\n```js\\nimport logo from \'./logo.svg\';\\nimport \'./App.css\';\\nimport styled from \'styled-components\'\\nimport { BrowserRouter, Routes, Route, Link } from \'react-router-dom\'\\nimport HookSample from \'./Components/HookSample.tsx\';\\nimport ContextSample from \'./Components/ContextSample.tsx\';\\n\\n\\n\\n\\n// styled components\\n\\n// styled Link in react-router-dom\\nconst StyledLink = styled(Link)`\\n  text-decoration: none;\\n`;\\n\\nconst Main = () => {\\n\\n  return (\\n    <Container>\\n      <Ul>\\n        <StyledLink to=\\"/HookSample\\">\\n          <Li>../HookSample.tsx</Li>\\n        </StyledLink>\\n        <StyledLink to=\\"/ContextSample\\">\\n          <Li>../ContextSample.tsx</Li>\\n        </StyledLink>\\n      </Ul>\\n    </Container>\\n  )\\n}\\n\\n\\n// main page li styled\\nfunction App() {\\n  return (\\n    <>\\n      <BrowserRouter>\\n        <Routes>\\n          <Route path=\'/\' element={<Main />}></Route>\\n          <Route path=\'/HookSample\' element={<HookSample />}></Route>\\n          <Route path=\'/ContextSample\' element={<ContextSample />}></Route>\\n        </Routes>\\n      </BrowserRouter>\\n    </>\\n  );\\n}\\n\\nexport default App;\\n```\\n\\n\\n\uc774\ub807\uac8c \uad6c\ud604\ud558\uc600\ub2e4... \uae30\ubcf8\uc608\uc81c\ub97c \ubc14\ud0d5\uc73c\ub85c \ub9cc\ub4e4\uace0 \uadf8\ub798\ub3c4 \uc2dc\uac04\uc774 \uc870\uae08 \ub9ce\uc774 \uac78\ub838\ub2e4. \\n\\n\uadf8\ub798\ub3c4 \ud655\uc2e4\ud558\uac8c \uc608\uc81c\ub97c \ubcf4\uc5ec\uc8fc\ub294 \ucef4\ud3ec\ub10c\ud2b8\ub85c \ubc14\ub85c\ubc14\ub85c \uc774\ub3d9\ud558\ub2c8\uae50 \ud655\uc2e4\ud788 \ubcf4\uae30\ub3c4 \ub9cc\ub4dc\ub294 \uc7ac\ubbf8\ub3c4 \uc788\uc5c8\ub2e4.\\n\\n\uc911\uac04\uc5d0 \ubcf4\uba74 lib\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \\\\<Link /> \ucef4\ud3ec\ub10c\ud2b8\ub97c  \uc2a4\ud0c0\uc77c\ud558\uae30 \uc704\ud574\uc11c style-components lib\uc744 \uc0ac\uc6a9\ud558\uc5ec\\n\\nlink \ud6a8\uacfc\ub97c \uc0ad\uc81c\ud588\ub2e4.\\n\\n\\n```js\\n// styled Link in react-router-dom\\nconst StyledLink = styled(Link)`\\n  text-decoration: none;\\n`;\\n```\\n\\n\uc774\ub807\uac8c \uc870\uae08\uc529 \ub9cc\ub4e4\uba74\uc11c \uc2e4\ub825\uc744 \ud0a4\uc6cc\ubcf4\uaca0\ub2e4. \uc194\uc9c1\ud788 \ube68\ub9ac \ub298\uace0\uc2f6\ub2e4... \uc77c\ub2e8 \ub9cc\ub4e4\uba74\uc11c \uacc4\uc18d \uc62c\ub824\ubcf4\uaca0\ub2e4."},{"id":"Upstream, DownStream","metadata":{"permalink":"/devlog/blog/Upstream, DownStream","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-04-13-UpstreamDownStrea-v2.md","source":"@site/blog/2022-04-13-UpstreamDownStrea-v2.md","title":"Upstream, DownStream","description":"\ud300 \ud504\ub85c\uc81d\ud2b8\ub97c \ud558\uba74\uc11c, \ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \uac19\uc740 \ud658\uacbd\uc5d0\uc11c \uc18c\uc2a4\uc758 \ubc84\uc804 \uad00\ub9ac\ub97c \ud574\uc57c\ud55c\ub2e4\ub294 \uac83\uc740 \uac70\uc758 \ub300\ubd80\ubd84 \uc54c \uac83\uc785\ub2c8\ub2e4.","date":"2022-04-13T00:00:00.000Z","formattedDate":"2022\ub144 4\uc6d4 13\uc77c","tags":[{"label":"github","permalink":"/devlog/blog/tags/github"},{"label":"git","permalink":"/devlog/blog/tags/git"}],"readingTime":3.555,"hasTruncateMarker":false,"authors":[{"name":"Sejune Oh","title":"Front End Engineer","url":"https://github.com/SejuneOh","imageURL":"https://avatars.githubusercontent.com/u/103201530?s=400&u=69cedf54cc5c427c96728a55d00e995b4dc9b145&v=4","key":"june"}],"frontMatter":{"slug":"Upstream, DownStream","title":"Upstream, DownStream","authors":"june","tags":["github","git"]},"prevItem":{"title":"React-Router-Dom \ud65c\uc6a9 \ubc0f Link \ud0dc\uadf8 \uc2a4\ud0c0\uc77c\ud558\uae30","permalink":"/devlog/blog/React-Router-Dom"}},"content":"\x3c!-- \uc804\ub2ec\ud558\uace0\uc790 \ud558\ub294 \ub0b4\uc6a9 --\x3e\\n\x3c!-- \ub0b4\uc6a9\uc5d0 \ub300\ud55c \uc2e0\ube59\uc131 --\x3e\\n\x3c!--  \uc7a0\uace0 \uc790\ub8cc \uc0ac\uc774\ud2b8 --\x3e\\n\\n\\n\x3c!-- \uc65c \uc774 \uae00\uc744 \uc4f0\uac8c \ub41c \ubaa9\uc801 --\x3e\\n\ud300 \ud504\ub85c\uc81d\ud2b8\ub97c \ud558\uba74\uc11c, \ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \uac19\uc740 \ud658\uacbd\uc5d0\uc11c \uc18c\uc2a4\uc758 \ubc84\uc804 \uad00\ub9ac\ub97c \ud574\uc57c\ud55c\ub2e4\ub294 \uac83\uc740 \uac70\uc758 \ub300\ubd80\ubd84 \uc54c \uac83\uc785\ub2c8\ub2e4.  \\n\ubaa8\ub4e0 \uac1c\ubc1c\uc744 \uc2dc\uc791\ud558\uba74\uc11c Git, Github\ub85c \ubc84\uc804 \uad00\ub9ac \ubc0f \uc18c\uc2a4 \uad00\ub9ac\ub97c \ud558\uc2dc\uba74\uc11c, Repo\uc758 admin\uc5d0\uac8c PR\uc744 \ubcf4\ub0b4\ub294 \uacbd\ud5d8\ub3c4 \ub9ce\uc774 \ud574\ubcf4\uc168\uc744 \uac83\uc785\ub2c8\ub2e4. \uc5ec\uae30\uc11c upstream, downstream\uc758 \uc774\uc57c\uae30\ub97c \ub4e4\uc5b4 \ubcf4\uc168\uc744 \uac83\uc774\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.  \\nrepository \uae30\uc900\uc73c\ub85c \uc0c1\ub300\uc801\uc778 \uac1c\ub150\uc778 \ub450 \ub2e8\uc5b4\uc5d0 \ub300\ud574\uc11c \uc815\uc758\ud55c \ub0b4\uc6a9\uc744 \ud3ec\uc2a4\ud305 \ud558\ub824\uace0 \ud569\ub2c8\ub2e4.\\n\\n---\\n\\n\\n## Git vs Github?\\n\\n\ud574\ub2f9 \ub2e8\uc5b4\uc758 \uac1c\ub150\uc744 \uc54c\uae30 \uc704\ud574\uc11c\ub294 \uc544\ub798\uc758 Git\uacfc Github\uc758 \uac1c\ub150\uc744 \uc774\ud574\ud574\uc57c \ud569\ub2c8\ub2e4.\\n\\n### [Git](https://git-scm.com/)\\n\\n- VSC(Version Control System) : \ubc84\uc804 \uad00\ub9ac\ub97c \ub3c4\uc640\uc8fc\uc2a4\ub294 \uc2dc\uc2a4\ud15c\\n- \uc18c\uc2a4\uc758 \ubc84\uc804 \uad00\ub9ac \ubc0f \uc0ac\uc6a9\uc790\ub4e4\uc758 \ucee4\ubc0b\uacfc \uc218\uc815 \ub0b4\uc6a9\uc744 \uc815\ub9ac\ud574\uc8fc\uace0 \uae30\ub85d\ud55c\ub2e4.\\n- \uad00\ub9ac\ud558\ub294 \ud504\ub85c\uc81d\ud2b8 \ud3f4\ub354\uc5d0\uc11c \uc124\uc815 \ubc0f \uc18c\uc2a4 \uad00\ub9ac\ub97c \ud574\uc900\ub2e4.\\n- \ubcd1\ub82c \uac1c\ubc1c\uc774 \uac00\ub2a5\ud558\ub2e4.(\ub3d9\uc2dc\uc5d0 \ud30c\uc77c \uc218\uc815\uc774 \uac00\ub2a5\ud558\ub2e4)\\n\\n\\n### [Github](https://github.com/)\\n\\n- \uc6d0\uaca9\uc73c\ub85c(\ub124\ud2b8\uc6cc\ud06c)\uc0c1\uc5d0\uc11c \uc18c\uc2a4 Git\uc758 \uae30\ub2a5\uc744 \ud574\uc8fc\ub294 \ud50c\ub7ab\ud3fc\uc785\ub2c8\ub2e4.\\n- \uc6d0\uaca9\uc73c\ub85c \uc18c\uc2a4 \uc218\uc815 \ubc0f \ub0b4\uc6a9\uc744 \ucde8\ud569\ud558\uace0, \ub0b4\uc6a9\uc744 \uae30\ub85d\ud574\uc8fc\uace0 \uc18c\uc2a4\ub97c \uc800\uc7a5\ud574\ub294 \uc6f9 \ud50c\ub7ab\ud3fc\uc785\ub2c8\ub2e4.\\n- \uc18c\uc2a4 \uad00\ub9ac \ubc0f \uc811\uadfc \uac00\ub2a5\ud55c \ud300\uc6d0 \ubcf4\uc548\ub4f1 \ub9ce\uc740 \uae30\ub2a5\uc744 \uc81c\uacf5\ud574\uc90d\ub2c8\ub2e4.\\n\\n\uc0c1\ub300\uc801\uc73c\ub85c 2\uac1c\ub294 \ube44\uc2b7\ud574\ubcf4\uc774\uc9c0\ub9cc \uac1c\ub150\uc740 \ub2e4\ub985\ub2c8\ub2e4. \uc815\ud655\ud788 \ub9d0\ud574\uc11c\ub294 \ub85c\uceec\uc758 git\uc73c\ub85c \uc791\uc5c5 \ud6c4, \uc791\uc5c5 \ub0b4\uc6a9\uc744 github\uc758 repo\ub85c \ubcf4\ub0b4\ub294 \uac83\uc785\ub2c8\ub2e4.\\n\\n--- \\n\\n## UpStream, DownStream\\n\\n### Upstream\\n\\n- \uc18c\uc2a4\uac00 \ucd5c\uc885\uc801\uc73c\ub85c \uad00\ub9ac\ub418\ub294 Repository\ub97c \ub9d0\ud569\ub2c8\ub2e4.\\n- \ud300\uc6d0, \ub2e4\ub978 \uac1c\ubc1c\uc790\uac00 \uc18c\uc2a4\ub97c \uc218\uc815\ud558\uace0 PR\uc744 \ubcf4\ub0b4\uace0 \ub2e4\ub978 \uc0ac\ub78c\uc774 \uc218\uc815\ud55c \ub0b4\uc6a9\uc744 \ub0b4\ub824 \ubc1b\ub294 \ucd5c\uc0c1\uc704 Repo\uc785\ub2c8\ub2e4.\\n\\n### Downstream\\n\\n- \ud604\uc7ac \ucd5c\uc0c1\uc704 Repo\uc5d0\uc11c \ud558\uc704 Repo \uc989, \uc790\uc2e0\uc774 \uc18c\uc2a4\ub97c \uac1c\ubc1c\ud558\ub294 \ud658\uacbd\uc744 \ub9d0\ud569\ub2c8\ub2e4. \\n- PR\uc744 \ubcf4\ub0b4\uace0, \uac1c\ubc1c \ubc0f \uc18c\uc2a4\ub97c \uad00\ub9ac\ud558\ub294 \ud658\uacbd\uc744 \ub9d0\ud569\ub2c8\ub2e4.\\n\\n\\n### \uc65c \uc0c1\ub300\uc801\uc778 \uac1c\ub150\uc778\uac00\\n\\n1. _\ub0b4\uac00 \ud63c\uc790 \uc2a4\uc2a4\ub85c \ud504\ub85c\uc81d\ud2b8\ub97c github\ub85c \uad00\ub9ac\ud588\uc744 \ub54c_  \\n   upstream: Gihub Repo  \\n   downstream: Local Git \ud658\uacbd\\n\\n\\n2. _\ud611\uc5c5\uc5d0\uc11c \ub2e4\ub978 \uc0ac\ub78c\uc758 \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c Fork(\uc0c1\ub300\ubc29\uc758 \uc18c\uc2a4\ub97c \uc790\uc2e0\uc758 repo\ub85c)\uc5d0\uc11c \uc791\uc5c5\ud560\ub54c_  \\n   upstream: Fork original repo  \\n   downstream: \uc790\uc2e0\uc758 Oraganization repo\\n\\n\uae30\uc900\uc774 \ub204\uad70\uac00\uc5d0 \ub530\ub978 \uc0c1\ub300\uc801\uc778 \uac1c\ub150\uc774\uae30 \ub54c\ubb38\uc5d0 \uc815\ub9ac\ud558\uba74\uc11c, \uacf5\ubd80\ud55c \ub0b4\uc6a9\uc744 \ud3ec\uc2a4\ud305\ud558\uba74\uc11c \uacf5\uc720\ud569\ub2c8\ub2e4.  \\n\uac10\uc0ac\ud569\ub2c8\ub2e4.\\n\\n---"}]}')}}]);